--


--
-- Déclencheurs presence
--
DROP TRIGGER IF EXISTS `presence_nom_jour`;
DELIMITER $$
CREATE TRIGGER `presence_nom_jour` BEFORE INSERT ON `presence`
 FOR EACH ROW BEGIN

SET NEW.jour = (CASE date_format(NEW.jourpresence,'%W')
          WHEN 'Monday' THEN 'Lundi'
          WHEN  'Tuesday' THEN 'Mardi'
          WHEN 'Wednesday' THEN 'Mercredi'
          WHEN 'Thursday' THEN 'Jeudi'
          WHEN 'Friday' THEN 'Vendredi'
          WHEN 'Saturday' THEN 'Samedi'
          WHEN 'Sunday' THEN 'Dimanche' 
     END) ;

SET NEW.nom = (select nom from benevole_tbl where benevole_tbl.idbenevole=NEW.idbenevole);   

SET NEW.prenom = (select prenom from benevole_tbl where benevole_tbl.idbenevole=NEW.idbenevole);  

SET NEW.nomsite = (select nomsite from site where site.idsite=NEW.idsite);

SET NEW.nomactivite = (select nomactivite from activite where activite.idactivite=NEW.idactivite);

SET NEW.nomrole = (select nomrole from role where role.idrole=NEW.idrole);
     
END
$$
DELIMITER ;

