CREATE ALGORITHM=UNDEFINED DEFINER=CURRENT_USER@localhost SQL SECURITY DEFINER VIEW restosapp.benevole_activite_vue AS select b.idbenevole AS idbenevole,(case (select distinct 1 from restosapp.engagement_vue e where ((e.idbenevole = b.idbenevole) and (e.nomactivite = 'Distribution'))) when 1 then 'oui' else 'non' end) AS distribution,(case (select distinct 1 from restosapp.engagement_vue e where ((e.idbenevole = b.idbenevole) and (e.nomactivite = 'Préparation'))) when 1 then 'oui' else 'non' end) AS preparation,(case (select distinct 1 from restosapp.engagement_vue e where ((e.idbenevole = b.idbenevole) and (e.nomactivite = 'Traçabilité'))) when 1 then 'oui' else 'non' end) AS tracabilite,(case (select distinct 1 from restosapp.engagement_vue e where ((e.idbenevole = b.idbenevole) and (e.nomactivite = 'Maraude'))) when 1 then 'oui' else 'non' end) AS maraude,(case (select distinct 1 from restosapp.engagement_vue e where ((e.idbenevole = b.idbenevole) and (e.nomactivite = 'Droits du coeur'))) when 1 then 'oui' else 'non' end) AS droitsducoeur,(case (select distinct 1 from restosapp.engagement_vue e where ((e.idbenevole = b.idbenevole) and (e.nomactivite = 'Prépa après-midi'))) when 1 then 'oui' else 'non' end) AS prepa_apresmidi from restosapp.benevole_tbl b;

