--
-- Structure de la vue benevole_all
--
DROP TABLE IF EXISTS `benevole_all`;

CREATE ALGORITHM=UNDEFINED DEFINER=CURRENT_USER@localhost SQL SECURITY DEFINER VIEW restosapp.benevole_all AS select b.idbenevole AS idbenevole,b.nom AS nom,b.prenom AS prenom,(case b.statut when 1 then 'Actif' else 'INACTIF' end) AS statut,ifnull((case b.sexe when '' then '  ' else b.sexe end),'   ') AS sexe,(case ifnull(b.datenaissance,'') when '' then ' ' else date_format(b.datenaissance,'%d/%m/%Y') end) AS datenaissance,(case ifnull(b.datenaissance,'') when '' then ' ' else (year(curdate()) - year(b.datenaissance)) end) AS age,(case ifnull(b.lieunaissance,'') when '' then ' ' else b.lieunaissance end) AS lieunaissance,(case ifnull(b.telephone,'') when '' then ' ' else cast(b.telephone as char charset utf8mb4) end) AS telephone,(case ifnull(b.email,'') when '' then ' ' else b.email end) AS email,ifnull((case b.adresse when '' then ' ' else b.adresse end),' ') AS adresse,ifnull((case b.ville when '' then ' ' else b.ville end),' ') AS ville,ifnull((case b.codepostal when '' then ' ' else b.codepostal end),' ') AS codepostal,ifnull(b.1ereinscription,'  ') AS 1ereinscription,(case ifnull(b.datem0,'') when '' then ' ' else date_format(b.datem0,'%d/%m/%Y') end) AS datem0,(case ifnull(b.dateinscriptioncourante,'') when '' then ' ' else date_format(b.dateinscriptioncourante,'%d/%m/%Y') end) AS dateinscriptioncourante,ifnull((case b.profession when '' then ' ' else b.profession end),' ') AS profession,ifnull((case b.ecole when '' then ' ' else b.ecole end),' ') AS ecole,(case b.annuaire when 1 then 'X' else ' ' end) AS annuaire,(case b.collegiale when 1 then 'X' else ' ' end) AS collegiale,(case b.accueilleur when 1 then 'X' else ' ' end) AS accueilleur,(case b.permis when 1 then 'X' else ' ' end) AS permis,(case b.permispl when 1 then 'X' else ' ' end) AS permispl,(case b.autorisationconduite when 1 then 'X' else ' ' end) AS autorisationconduite,ifnull((case b.remarque when '' then ' ' else b.remarque end),' ') AS remarque,ifnull((case b.contact when '' then ' ' else b.contact end),' ') AS contact,ifnull((case b.annee when '' then ' ' else b.annee end),' ') AS annee,(case b.supportadm when 1 then 'X' else ' ' end) AS supportadm,(case a.droitsducoeur when 'oui' then 'X' else ' ' end) AS droitsducoeur,(case a.maraude when 'oui' then 'X' else ' ' end) AS maraude,(case a.distribution when 'oui' then 'X' else ' ' end) AS distribution,(case a.preparation when 'oui' then 'X' else ' ' end) AS preparation,(case a.prepa_apresmidi when 'oui' then 'X' else ' ' end) AS prepa_apresmidi,(case a.tracabilite when 'oui' then 'X' else ' ' end) AS tracabilite from (restosapp.benevole_tbl b join restosapp.benevole_activite_vue a on((b.idbenevole = a.idbenevole)));

