--
-- Structure de la vue benevole_vue
--
DROP TABLE IF EXISTS `benevole_vue`;

CREATE ALGORITHM=UNDEFINED DEFINER=CURRENT_USER@localhost SQL SECURITY DEFINER VIEW restosapp.benevole_vue AS select restosapp.benevole_tbl.idbenevole AS idbenevole,restosapp.benevole_tbl.nom AS nom,restosapp.benevole_tbl.prenom AS prenom,restosapp.benevole_tbl.statut AS statut,restosapp.benevole_tbl.telephone AS telephone,restosapp.benevole_tbl.email AS email,restosapp.benevole_tbl.permis AS permis,restosapp.benevole_tbl.motdepasse AS motdepasse,ifnull(restosapp.benevole_tbl.datemiseajour,'') AS datemaj,count(distinct restosapp.engagement.idactivite,restosapp.engagement.idsite,restosapp.engagement.jourdefaut,restosapp.engagement.idbenevole) AS nb_engagements,sum((case when (ifnull(restosapp.presence.etat,'') = 'present') then 1 else 0 end)) AS nb_presents,benevole_activite_vue.distribution AS distribution,benevole_activite_vue.preparation AS preparation,benevole_activite_vue.tracabilite AS tracabilite,benevole_activite_vue.droitsducoeur AS droitsducoeur,benevole_activite_vue.maraude AS maraude,restosapp.benevole_tbl.sexe AS sexe,ifnull(restosapp.benevole_tbl.datenaissance,'') AS datenaissance,(case ifnull(restosapp.benevole_tbl.datenaissance,'') when '' then ' ' else (year(curdate()) - year(restosapp.benevole_tbl.datenaissance)) end) AS age,ifnull(restosapp.benevole_tbl.lieunaissance,'') AS lieunaissance,restosapp.benevole_tbl.adresse AS adresse,restosapp.benevole_tbl.codepostal AS codepostal,restosapp.benevole_tbl.ville AS ville,restosapp.benevole_tbl.permispl AS permispl,restosapp.benevole_tbl.autorisationconduite AS autorisationconduite,restosapp.benevole_tbl.profession AS profession,restosapp.benevole_tbl.ecole AS ecole,restosapp.benevole_tbl.annuaire AS annuaire,restosapp.benevole_tbl.collegiale AS collegiale,ifnull(restosapp.benevole_tbl.1ereinscription,'') AS 1ereinscription,ifnull(restosapp.benevole_tbl.datem0,'') AS datem0,ifnull(restosapp.benevole_tbl.dateinscriptioncourante,'') AS dateinscriptioncourante,restosapp.benevole_tbl.accueilleur AS accueilleur,ifnull(restosapp.benevole_tbl.contact,'') AS contact,ifnull(restosapp.benevole_tbl.remarque,'') AS remarque,ifnull((case restosapp.benevole_tbl.annee when '' then '   ' else restosapp.benevole_tbl.annee end),'   ') AS annee,restosapp.benevole_tbl.supportadm AS supportadm from (((restosapp.benevole_tbl left join restosapp.engagement on((restosapp.benevole_tbl.idbenevole = restosapp.engagement.idbenevole))) left join restosapp.benevole_activite_vue on((restosapp.benevole_tbl.idbenevole = benevole_activite_vue.idbenevole))) left join restosapp.presence on(((restosapp.engagement.jourdefaut = restosapp.presence.jour) and (restosapp.engagement.idactivite = restosapp.presence.idactivite) and (restosapp.engagement.idsite = restosapp.presence.idsite) and (restosapp.engagement.idbenevole = restosapp.presence.idbenevole)))) group by restosapp.benevole_tbl.idbenevole,restosapp.benevole_tbl.nom,restosapp.benevole_tbl.prenom,restosapp.benevole_tbl.telephone,restosapp.benevole_tbl.email,restosapp.benevole_tbl.permis,restosapp.benevole_tbl.motdepasse,restosapp.benevole_tbl.datemiseajour,benevole_activite_vue.distribution,benevole_activite_vue.preparation,benevole_activite_vue.tracabilite;

-- --------------------------------------------------------

--
-- Structure de la vue engagement_vue
--
DROP TABLE IF EXISTS `engagement_vue`;

CREATE ALGORITHM=UNDEFINED DEFINER=CURRENT_USER@localhost SQL SECURITY DEFINER VIEW restosapp.engagement_vue AS select restosapp.activite.nomactivite AS nomactivite,restosapp.site.nomsite AS nomsite,(case restosapp.engagement.jourdefaut when '' then ' ' else restosapp.engagement.jourdefaut end) AS jourdefaut,restosapp.benevole_tbl.nom AS nom,restosapp.benevole_tbl.prenom AS prenom,concat(restosapp.benevole_tbl.prenom,' ',restosapp.benevole_tbl.nom) AS benevole,ifnull(restosapp.engagement.datedebut,'') AS datedebut,ifnull(restosapp.engagement.datefin,'') AS datefin,restosapp.role.nomrole AS nomrole,(case restosapp.benevole_tbl.autorisationconduite when 1 then 'X' else ' ' end) AS autorisationconduite,(case restosapp.benevole_tbl.statut when 1 then 'Actif' else 'INACTIF' end) AS statut,(case restosapp.engagement.jourdefaut when 'Lundi' then 1 when 'Mardi' then 2 when 'Mercredi' then 3 when 'Jeudi' then 4 when 'Vendredi' then 5 when 'Samedi' then 6 when 'Dimanche' then 7 else 0 end) AS numjoursem,restosapp.engagement.id AS id,restosapp.engagement.idbenevole AS idbenevole,restosapp.engagement.idactivite AS idactivite,restosapp.engagement.idsite AS idsite,restosapp.engagement.idrole AS idrole from ((((restosapp.engagement join restosapp.activite on((restosapp.activite.idactivite = restosapp.engagement.idactivite))) join restosapp.site on((restosapp.site.idsite = restosapp.engagement.idsite))) join restosapp.role on((restosapp.role.idrole = restosapp.engagement.idrole))) join restosapp.benevole_tbl on((restosapp.benevole_tbl.idbenevole = restosapp.engagement.idbenevole)));

