CREATE ALGORITHM=UNDEFINED DEFINER=CURRENT_USER@localhost SQL SECURITY DEFINER VIEW restosapp.infos_vue AS select restosapp.infos.idactivite AS idactivite,restosapp.infos.idrole AS idrole,ifnull(restosapp.activite.nomactivite,'') AS nomactivite,ifnull(restosapp.role.nomrole,'') AS nomrole,restosapp.infos.commentaire AS commentaire,restosapp.infos.lien AS lien from ((restosapp.infos left join restosapp.activite on((restosapp.infos.idactivite = restosapp.activite.idactivite))) left join restosapp.role on((restosapp.infos.idrole = restosapp.role.idrole))) order by restosapp.infos.idactivite;

