DROP TABLE IF EXISTS `presence_count`;

CREATE ALGORITHM=UNDEFINED DEFINER=CURRENT_USER@localhost SQL SECURITY DEFINER VIEW restosapp.presence_count AS select p.jourpresence AS jourpresence,a.nomactivite AS nomactivite,s.nomsite AS nomsite,count(0) AS nombre_present,p.idactivite AS idactivite,p.idsite AS idsite from ((restosapp.presence p join restosapp.activite a) join restosapp.site s) where ((a.idactivite = p.idactivite) and (s.idsite = p.idsite) and (p.etat = 'Présent')) group by p.jourpresence,a.nomactivite,s.nomsite,p.idactivite,p.idsite,a.nomactivite,s.nomsite;

