--
-- Structure de la vue presence_histo
--
DROP TABLE IF EXISTS `presence_histo`;

CREATE ALGORITHM=UNDEFINED DEFINER=CURRENT_USER@localhost SQL SECURITY DEFINER VIEW restosapp.presence_histo AS select str_to_date(restosapp.table_date.jour,'%d/%m/%Y') AS Date_intervention,engagement_vue.jourdefaut AS Jour,(case engagement_vue.jourdefaut when 'Lundi' then 1 when 'Mardi' then 2 when 'Mercredi' then 3 when 'Jeudi' then 4 when 'Vendredi' then 5 when 'Samedi' then 6 when 'Dimanche' then 7 else 8 end) AS numjoursem,engagement_vue.nomactivite AS nomactivite,engagement_vue.nomsite AS nomsite,engagement_vue.nom AS nom,engagement_vue.prenom AS prenom,engagement_vue.benevole AS benevole,engagement_vue.nomrole AS nomrole,ifnull(restosapp.presence.etat,'Non défini') AS etat,engagement_vue.idactivite AS idactivite,engagement_vue.idsite AS idsite,engagement_vue.idbenevole AS idbenevole,engagement_vue.idrole AS idrole from ((((((restosapp.table_date join restosapp.engagement_vue on((restosapp.table_date.joursemaine = engagement_vue.jourdefaut))) join restosapp.activite on((restosapp.activite.idactivite = engagement_vue.idactivite))) join restosapp.site on((engagement_vue.idsite = restosapp.site.idsite))) join restosapp.role on((engagement_vue.idrole = restosapp.role.idrole))) join restosapp.benevole_tbl on((engagement_vue.idbenevole = restosapp.benevole_tbl.idbenevole))) left join restosapp.presence on(((str_to_date(restosapp.table_date.jour,'%d/%m/%Y') = restosapp.presence.jourpresence) and (engagement_vue.idactivite = restosapp.presence.idactivite) and (engagement_vue.idsite = restosapp.presence.idsite) and (engagement_vue.idrole = restosapp.presence.idrole) and (engagement_vue.idbenevole = restosapp.presence.idbenevole)))) where ((str_to_date(restosapp.table_date.jour,'%d/%m/%Y') < curdate()) and (str_to_date(restosapp.table_date.jour,'%d/%m/%Y') >= (curdate() - interval 12 month)));

-- --------------------------------------------------------

--
-- Structure de la vue presence_mois
--
DROP TABLE IF EXISTS `presence_mois`;

CREATE ALGORITHM=UNDEFINED DEFINER=CURRENT_USER@localhost SQL SECURITY DEFINER VIEW restosapp.presence_mois AS select str_to_date(d.jour,'%d/%m/%Y') AS jourpresence,d.joursemaine AS jour,(case d.joursemaine when 'Lundi' then 1 when 'Mardi' then 2 when 'Mercredi' then 3 when 'Jeudi' then 4 when 'Vendredi' then 5 when 'Samedi' then 6 when 'Dimanche' then 7 else 8 end) AS numjoursem,e.nomactivite AS nomactivite,e.nomsite AS nomsite,e.nom AS nom,e.prenom AS prenom,e.benevole AS benevole,e.nomrole AS nomrole,e.autorisationconduite AS autorisationconduite,ifnull(restosapp.presence.etat,'Non défini') AS etat,ifnull(restosapp.presence.commentaire,'') AS commentaire,ifnull(presence_count.nombre_present,0) AS nombre_present,e.datefin AS datefin,e.idactivite AS idactivite,e.idsite AS idsite,e.idbenevole AS idbenevole,e.idrole AS idrole,restosapp.presence.id AS idpresence from (((restosapp.table_date d join restosapp.engagement_vue e on((d.joursemaine = e.jourdefaut))) left join restosapp.presence on(((str_to_date(d.jour,'%d/%m/%Y') = restosapp.presence.jourpresence) and (e.idactivite = restosapp.presence.idactivite) and (e.idsite = restosapp.presence.idsite) and (e.idbenevole = restosapp.presence.idbenevole)))) left join restosapp.presence_count on(((e.idactivite = presence_count.idactivite) and (e.idsite = presence_count.idsite) and (str_to_date(d.jour,'%d/%m/%Y') = presence_count.jourpresence)))) where ((str_to_date(d.jour,'%d/%m/%Y') >= (curdate() + interval -(2) day)) and (str_to_date(d.jour,'%d/%m/%Y') <= (curdate() + interval 1 month)) and ((case e.datefin when '' then now() else e.datefin end) >= now())) union select p.jourpresence AS jourpresence,p.jour AS jour,(case p.jour when 'Lundi' then 1 when 'Mardi' then 2 when 'Mercredi' then 3 when 'Jeudi' then 4 when 'Vendredi' then 5 when 'Samedi' then 6 when 'Dimanche' then 7 else 8 end) AS numjoursem,a.nomactivite AS nomactivite,s.nomsite AS nomsite,b.nom AS nom,b.prenom AS prenom,concat(b.prenom,' ',b.nom) AS benevole,r.nomrole AS nomrole,b.autorisationconduite AS autorisationconduite,ifnull(p.etat,'Non défini') AS etat,ifnull(p.commentaire,'') AS commentaire,ifnull(presence_count.nombre_present,0) AS nombre_present,'' AS datefin,p.idactivite AS idactivite,p.idsite AS idsite,p.idbenevole AS idbenevole,p.idrole AS idrole,p.id AS idpresence from ((((restosapp.activite a join restosapp.site s) join restosapp.role r) join restosapp.benevole_tbl b) join (restosapp.presence p left join restosapp.presence_count on(((p.idactivite = presence_count.idactivite) and (p.idsite = presence_count.idsite) and (p.jourpresence = presence_count.jourpresence))))) where ((p.idactivite = a.idactivite) and (s.idsite = p.idsite) and (p.idrole = r.idrole) and (p.idbenevole = b.idbenevole) and (p.jourpresence >= (curdate() + interval -(2) day)) and (not((p.idbenevole,p.idactivite,p.idsite,p.jour) in (select w.idbenevole,w.idactivite,w.idsite,w.jourdefaut from restosapp.engagement w))));

