DROP TABLE IF EXISTS `presence_mois_synthese`;

CREATE ALGORITHM=UNDEFINED DEFINER=CURRENT_USER@localhost SQL SECURITY DEFINER VIEW restosapp.presence_mois_synthese AS select presence_mois.jourpresence AS jourpresence,presence_mois.numjoursem AS numjoursem,presence_mois.nomactivite AS nomactivite,presence_mois.nomsite AS nomsite,sum((case when (presence_mois.etat = 'Non défini') then 1 else 0 end)) AS nondefini,sum((case when (presence_mois.etat = 'Absent') then 1 else 0 end)) AS absent,sum((case when (presence_mois.etat = 'Présent') then 1 else 0 end)) AS present from restosapp.presence_mois group by presence_mois.jourpresence,presence_mois.numjoursem,presence_mois.nomactivite,presence_mois.nomsite order by presence_mois.jourpresence,presence_mois.nomactivite,presence_mois.nomsite;

