-- Structure de la vue xx_benevole
--
DROP TABLE IF EXISTS `xx_benevole`;

CREATE ALGORITHM=UNDEFINED DEFINER=CURRENT_USER@localhost SQL SECURITY DEFINER VIEW restosapp.xx_benevole AS select restosapp.benevole_tbl.idbenevole AS idbenevole,restosapp.benevole_tbl.datemiseajour AS datemiseajour,restosapp.benevole_tbl.email AS email,restosapp.benevole_tbl.motdepasse AS motdepasse,restosapp.benevole_tbl.nom AS nom,restosapp.benevole_tbl.permis AS permis,restosapp.benevole_tbl.prenom AS prenom,restosapp.benevole_tbl.telephone AS telephone,restosapp.benevole_tbl.statut AS statut from restosapp.benevole_tbl where (restosapp.benevole_tbl.statut = 1);

