--
-- Structure de la vue xx_referent_activite_vue
--
DROP TABLE IF EXISTS `xx_referent_activite_vue`;

CREATE ALGORITHM=UNDEFINED DEFINER=CURRENT_USER@localhost SQL SECURITY DEFINER VIEW restosapp.xx_referent_activite_vue AS select b.idbenevole AS idbenevole,(case (select distinct 1 from restosapp.engagement_vue e where ((e.idbenevole = b.idbenevole) and (e.nomrole = 'REFERENT') and (e.nomactivite = 'Distribution'))) when 1 then 'oui' else 'non' end) AS distribution,(case (select distinct 1 from restosapp.engagement_vue e where ((e.idbenevole = b.idbenevole) and (e.nomrole = 'REFERENT') and (e.nomactivite = 'Préparation'))) when 1 then 'oui' else 'non' end) AS preparation,(case (select distinct 1 from restosapp.engagement_vue e where ((e.idbenevole = b.idbenevole) and (e.nomrole = 'REFERENT') and (e.nomactivite = 'Maraude'))) when 1 then 'oui' else 'non' end) AS maraude,(case (select distinct 1 from restosapp.engagement_vue e where ((e.idbenevole = b.idbenevole) and (e.nomrole = 'REFERENT') and (e.nomactivite = 'Droits du coeur'))) when 1 then 'oui' else 'non' end) AS droitsducoeur from restosapp.benevole_tbl b where b.idbenevole in (select engagement_vue.idbenevole from restosapp.engagement_vue where ((engagement_vue.nomrole = 'REFERENT') and (engagement_vue.nomactivite <> 'Traçabilité')));

