INSERT INTO notification_model (idmodel, titre, texte, sqlcmd) VALUES
('Modele_rappel_distrib', 'Distribution restos du Coeur', 'Tu es attendu(e) le &date à 18h au 27 Chemin du Séminaire à Toulouse (ou directement sur site si agréé avec ton référent) pour la distribution des repas du soir sur le site &nomsite', 'SELECT DATE_FORMAT(jourpresence, ''%d/%m/%Y'') as date, tokennotification, prenom,nomactivite,nomsite FROM presence_mois, token_notification \nWHERE (( DATEDIFF(jourpresence, NOW()) < 2) AND ( DATEDIFF(jourpresence, NOW()) >= 1) AND (etat = ''Présent'') \nAND idactivite=3\nAND (presence_mois.idbenevole = token_notification.idbenevole));'),
('Modele_rappel_prepa', 'Préparation restos du Coeur', 'Tu es attendu(e) le &date à 9h au 27 Chemin du Séminaire à Toulouse pour la préparation du matin sur le site &nomsite', 'SELECT DATE_FORMAT(jourpresence, ''%d/%m/%Y'') as date, tokennotification, prenom,nomactivite,nomsite FROM presence_mois, token_notification \r\nWHERE (( DATEDIFF(jourpresence, NOW()) < 2) AND ( DATEDIFF(jourpresence, NOW()) >= 1) AND (etat = ''Présent'') \r\nAND idactivite=2\r\nAND (presence_mois.idbenevole = token_notification.idbenevole));'),
('Modele_relance', 'Engagement aux Restos du Coeur non défini', '&prenom, vous ne vous êtes pas encore inscrit pour l''activité de &nomactivite dans 4 jours, sur le site &nomsite.', 'SELECT `presence_mois`.`jourpresence`,  `token_notification`.`tokennotification`, `presence_mois`.`prenom`, `presence_mois`.`nomactivite`, `presence_mois`.`nomsite`\r\nFROM `presence_mois`, `token_notification`\r\nWHERE (( DATEDIFF(jourpresence, NOW()) < 4) AND ( DATEDIFF(jourpresence, NOW()) >= 3) AND (etat = ''Non défini'') AND (`presence_mois`.`idbenevole` = `token_notification`.`idbenevole`) and idactivite=3);\r\n\r\n'),
('Modele_relance prépa', 'Engagement aux Restos du Coeur non défini', '&prenom, vous ne vous êtes pas encore inscrit pour l''activité de &nomactivite dans 4 jours, sur le site &nomsite.', 'SELECT `presence_mois`.`jourpresence`,  `token_notification`.`tokennotification`, `presence_mois`.`prenom`, `presence_mois`.`nomactivite`, `presence_mois`.`nomsite`\r\nFROM `presence_mois`, `token_notification`\r\nWHERE (( DATEDIFF(jourpresence, NOW()) < 4) AND ( DATEDIFF(jourpresence, NOW()) >= 3) AND (etat = ''Non défini'') AND (`presence_mois`.`idbenevole` = `token_notification`.`idbenevole`)  and idactivite=2);\r\n\r\n');
