INSERT INTO req (id, comment, txt) VALUES
('AP_ALL_BENEVOLE', 'AP - liste de tous les bénévoles - procédure ajout bénévole à une activité/site/jour', 'SELECT prenom,nom,email,telephone,idbenevole from benevole_tbl\r\norder by prenom,nom'),
('AP_CHECK_REFERENT', 'AP - Vrai si bénévole référent', 'SELECT EXISTS(SELECT id FROM engagement WHERE idbenevole =  :P_IDBENEVOLE AND idrole = 2) as ref'),
('AP_CHECK_RESPONSABLE', 'AP - Vrai si bénévole responsable', 'SELECT EXISTS(SELECT idactivite  FROM activite_resp   WHERE idbenevole =  :P_IDBENEVOLE) as resp'),
('AP_DEL_PRESENCE', 'AP - Suppression  enregistrement présence  (équivalent à état Non Défini)', 'DELETE FROM presence where idbenevole=:P_IDBENEVOLE and  jourpresence= :P_JOURPRESENCE and idactivite= :P_IDACTIVITE and idsite= :P_IDSITE'),
('AP_INS_PRESENCE', 'AP - Création enregistrement présence (état=Présent)', 'INSERT INTO presence (idbenevole,etat, jourpresence, idactivite, idsite,idrole) VALUES (:P_IDBENEVOLE,''Présent'',:P_JOURPRESENCE, :P_IDACTIVITE, :P_IDSITE, :P_IDROLE)'),
('AP_INS_SUIVI_ACTIVITE', 'AP - insertion informations activité', 'insert into suivi_activite (idactivite,idsite,jour,nombre_beneficiaire,commentaire) values (:P_IDACTIVITE,:P_IDSITE,:P_JOUR, :P_NOMBREBENEFICIAIRE,:P_COMMENTAIRE)'),
('AP_LOGOUT', 'AP - Suppression des tokens lors de la déconnexion', 'delete from token where token = :P_TOKEN;DELETE FROM token_notification WHERE tokennotification = :P_TOKENNOTIF;'),
('AP_LST_CONTACT', 'AP - Liste des contact  pour un bénévole (référents)\r\n\r\nÉcran Mes contacts', 'SELECT jourdefaut,nomactivite,nomsite,e.nom,e.prenom,e.idbenevole, telephone,email FROM  engagement_vue e, benevole_tbl b WHERE e.idbenevole=b.idbenevole and idrole=2  and e.idbenevole != :P_IDBENEVOLE and (jourdefaut,nomactivite,nomsite) in (SELECT jourdefaut,nomactivite,nomsite from engagement_vue where idbenevole= :P_IDBENEVOLE)'),
('AP_LST_ENG_BEN', 'AP - liste des engagements  benevole - Ecran Mon compte', 'SELECT jourdefaut,nomactivite,nomsite,nomrole,id as idengagement from engagement_vue where idbenevole= :P_IDBENEVOLE order by numjoursem,nomactivite,nomsite'),
('AP_LST_INFO', 'AP - liste des informations (URL)', 'select idactivite,idrole,commentaire,lien from infos where idactivite=0 and idrole=0\r\nUNION \r\nselect idactivite,idrole,commentaire,lien from infos where (idactivite,idrole) in (select idactivite,idrole from engagement where idbenevole=:P_IDBENEVOLE)\r\nUNION\r\nselect idactivite,idrole,commentaire,lien from infos where idactivite=99 and idrole=99 and :P_IDBENEVOLE in (select idbenevole from benevole_tbl where collegiale = 1)\r\norder by 1,2,3 desc'),
('AP_LST_PRE_BEN', 'AP - Liste des présences bénévole sur les engagements du mois à venir -  Ecran Liste des engagements', 'SELECT jourpresence,nomactivite,nomsite,nomrole,etat,commentaire,nombre_present,jour,idpresence,idactivite,idsite,idrole from presence_mois where idbenevole= :P_IDBENEVOLE order by jourpresence,nomactivite,nomsite'),
('AP_LST_PRE_EQU', 'AP - Liste des présences équipe un bénévole pour activité/site/jour donné - Ecran Liste des bénévoles pour une activité, un site et un jour', 'SELECT jourpresence,p.nomactivite,p.nomsite,p.prenom,p.nom,p.nomrole,etat,p.commentaire, idpresence,p.idbenevole,email,telephone FROM presence_mois p, benevole_tbl b where p.idbenevole=b.idbenevole and date_format(jourpresence,''%Y-%m-%d'')= :P_JOUR and idactivite= :P_IDACTIVITE AND idsite= :P_IDSITE order by jourpresence, p.nomactivite, p.nomsite, p.prenom, p.nom'),
('AP_LST_SUIVI_ACTIVITE', 'AP - suivi activite', 'SELECT nombre_beneficiaire,commentaire FROM suivi_activite where idactivite= :P_IDACTIVITE and idsite= :P_IDSITE and jour= :P_JOUR'),
('AP_LST_SYN_REF', 'AP - Synthèse activité - site pour un referent- Ecran Synthèse référent ', 'SELECT distinct p.jourpresence,nomactivite,nomsite,nombre_present,ifnull(total,0) Tous_sites ,p.idactivite,p.idsite FROM presence_mois p left join (select jourpresence,idactivite,count(*) total from presence_mois where etat=''Présent'' group by jourpresence,idactivite) t  on t.idactivite=p.idactivite and t.jourpresence=p.jourpresence           \r\nwhere idbenevole= :P_IDBENEVOLE and idrole=2 order by p.jourpresence,nomactivite,nomsite'),
('AP_LST_SYN_RESP', 'AP - Liste des activités si responsable activite', 'SELECT distinct p.jourpresence,nomactivite,nomsite,nombre_present,ifnull(total,0) Tous_sites, p.idactivite,p.idsite FROM presence_mois p left join (select jourpresence,idactivite,count(*) total from presence_mois where etat=''Présent'' group by jourpresence,idactivite) t  on t.idactivite=p.idactivite and t.jourpresence=p.jourpresence where ( p.idactivite) in (select a.idactivite from activite_resp a where idbenevole=:P_IDBENEVOLE) and p.jourpresence between date_add(curdate(),interval -1 day) and date_add(curdate(),interval +7 day) order by p.jourpresence,nomactivite,nomsite'),
('AP_MON_COMPTE', 'AP - données bénévoles\r\n\r\nEcran Mon compte', 'select nom,prenom,email,telephone,idbenevole from benevole_tbl where idbenevole= :P_IDBENEVOLE'),
('AP_UPD_INFO_BENEVOLE', 'AP - mise à jour informations bénévole (mail/tel)', 'update benevole_tbl b, token t set email = :P_EMAIL, telephone = :P_TELEPHONE where token = :P_TOKEN and t.idbenevole = b.idbenevole'),
('AP_UPD_NOTIF', 'AP - Ajout/Mise à jour  paire utilisateur/ token de notification', 'DELETE FROM token_notification\r\nWHERE tokennotification = :P_TOKENNOTIF;\n\nINSERT INTO token_notification (idbenevole, tokennotification)\r\nVALUES (:P_IDBENEVOLE, :P_TOKENNOTIF);'),
('AP_UPD_PRESENCE', 'AP - Mise à jour  enregistrement présence (état=Absent)', 'UPDATE presence set etat=''Absent'', commentaire= :P_COMMENTAIRE where idbenevole= :P_IDBENEVOLE and  jourpresence= :P_JOURPRESENCE and idactivite= :P_IDACTIVITE and idsite= :P_IDSITE'),
('AP_UPD_SUIVI_ACTIVITE', 'AP - mise à jour informations activité', 'update suivi_activite set nombre_beneficiaire= :P_NOMBREBENEFICIAIRE,commentaire=:P_COMMENTAIRE where  idactivite= :P_IDACTIVITE and idsite= :P_IDSITE and jour= :P_JOUR'),
('CFG_CHK_ACCES', 'Contrôle accès utilisateur', 'select b.idbenevole from benevole_tbl b inner join acces a on a.idbenevole=b.idbenevole where upper(email)=upper(''P_EMAIL'')'),
('CFG_INSERT_SITE', 'Création site', 'insert into site (nomsite,infosite) values (''P_NOMSITE'',''P_INFOSITE'')'),
('CFG_LISTE_MENU', 'Liste menu autorisé', 'SELECT libelle from fonction f inner join profil_fonction p on f.code=p.code_fonction inner join acces a on a.idprofil=p.idprofil where idbenevole=P_IDBENEVOLE order by ordre'),
('CFG_LISTE_SITE', 'liste des site', 'select nomsite,infosite from site  order by nomsite'),
('GS_BENEVOLES_APPLI', 'GS - liste des bénévoles indentifiés dans l''application', 'SELECT distinct nomactivite,nomsite,prenom,nom from engagement_vue where idbenevole in (select idbenevole from presence) order by 1,2,3'),
('GS_BENEVOLES_DISPARUS', 'GS - Benevoles non inscrits depuis 2 mois', 'SELECT e.jourdefaut,nomsite,prenom,nom FROM engagement e, activite a,site s, benevole_tbl b WHERE e.idactivite=a.idactivite and e.idsite=s.idsite and e.idbenevole=b.idbenevole and nomactivite=''P_NOMACTIVITE'' and e.idbenevole not in (select distinct idbenevole from presence where nomactivite=''P_NOMACTIVITE'' and etat=''Présent'' and jourpresence > date_add(curdate(),interval -61 day)) order by 1,2,3 '),
('GS_BENEVOLE_NOEL', 'GS - Liste des benevolesde noel inscrits', 'SELECT date_format(jourpresence,''%Y-%m-%d'') date, jour,prenom,nom, nomrole,etat,case when ifnull(commentaire,'''')='''' then '' '' else replace(replace(commentaire,CHAR(10),''. ''),'','','' -'')  end commentaire FROM presence_mois WHERE nomsite=''Bénévoles noel''   and jourpresence>  str_to_date(''2021-12-19'',''%Y-%m-%d'') order by 1 ,3,4'),
('GS_LST_BEN_ACT', 'GS - Liste bénévoles par activite', 'SELECT distinct ''X'' noprint, b.nom,b.prenom,telephone,email,sexe,datenaissance,lieunaissance,age, adresse,ville,codepostal,profession,annuaire,permis,permispl,b.autorisationconduite,contact,annee FROM engagement_vue v,benevole_all b WHERE v.idbenevole=b.idbenevole and nomactivite=''P_NOMACTIVITE'' ORDER BY b.prenom,b.nom '),
('GS_LST_BEN_ACTIF', 'GS - Liste totale bénévoles actifs', 'SELECT distinct ''X'' noprint, nom,prenom,telephone,email, tracabilite,preparation,prepa_apresmidi,distribution,droitsducoeur, maraude,supportadm, collegiale,accueilleur,sexe,datenaissance,lieunaissance,age,adresse,ville,codepostal,profession,contact,annee, annuaire,permis,permispl,autorisationconduite FROM benevole_all where idbenevole in (select idbenevole from engagement UNION select idbenevole from benevole_all where supportadm !=''X'' or accueilleur != ''X'') ORDER BY prenom,nom'),
('GS_LST_BEN_INACTIF', 'GS - Liste totale bénévoles sans engagements', 'SELECT distinct ''X'' noprint, nom,prenom,telephone,email,  sexe,datenaissance,lieunaissance,age,adresse,ville,codepostal,profession,contact,annee, annuaire,permis,permispl,autorisationconduite  FROM benevole_all where idbenevole not in (select idbenevole from engagement UNION select idbenevole from benevole_all where supportadm = ''X'' or accueilleur = ''X'') ORDER BY nom,prenom'),
('GS_LST_CHAUFFEUR', '', 'select ''X'',jourdefaut,nomsite,b.nom,b.prenom,email,telephone,numjoursem from engagement_vue e,benevole_all b where e.idbenevole=b.idbenevole   and nomactivite=''P_NOMACTIVITE'' and b.autorisationconduite=''X'' order by numjoursem,nomsite'),
('GS_LST_ENG', 'GS - Liste engagements pour toutes activités', 'SELECT  jourdefaut "Jour",concat(nomactivite,''  - '',nomsite )  activité, v.prenom,v.nom, v.nomrole "Role",  telephone , email annee ,numjoursem FROM engagement_vue v,benevole_all b WHERE v.idbenevole=b.idbenevole ORDER BY numjoursem,concat(nomactivite,''  - '',nomsite ),v.prenom,v.nom'),
('GS_LST_ENG_ACT', 'GS - Liste engagements par activite', 'SELECT ''X'' noprint, jourdefaut "Jour",nomsite "Site",v.prenom,v.nom, v.nomrole "Role",  telephone , email ,annee ,nomactivite  "Activite",numjoursem FROM engagement_vue v,benevole_all b WHERE v.idbenevole=b.idbenevole and nomactivite=''P_NOMACTIVITE'' ORDER BY numjoursem,nomsite,v.prenom,v.nom'),
('GS_LST_ESTIV_BEN_BA', 'GS - Liste bénévoles ESTIVAL BA', 'SELECT distinct ''X'' noprint, b.nom,b.prenom,telephone,email,sexe,datenaissance,lieunaissance,age, adresse,ville,codepostal,profession,commentaire, enquete FROM benevole_all b WHERE enquete=''ESTIVAL BA'' ORDER BY 3,2 '),
('GS_LST_ESTIV_BEN_RDC', 'GS - Liste bénévoles ESTIVAL RDC', 'SELECT distinct ''X'' noprint, b.nom,b.prenom,telephone,email,sexe,datenaissance,lieunaissance,age, adresse,ville,codepostal,profession,commentaire, enquete FROM benevole_all b WHERE enquete=''ESTIVAL RDC'' ORDER BY b.prenom,b.nom '),
('GS_LST_ESTIV_BEN_SC', 'GS - Liste bénévoles ESTIVAL SC', 'SELECT distinct ''X'' noprint, b.nom,b.prenom,telephone,email,sexe,datenaissance,lieunaissance,age, adresse,ville,codepostal,profession,commentaire, enquete FROM benevole_all b WHERE enquete=''ESTIVAL SC'' UNION SELECT distinct ''X'' noprint, b.nom,b.prenom,telephone,email,sexe,datenaissance,lieunaissance,age, adresse,ville,codepostal,profession,commentaire, enquete FROM benevole_all b, engagement_vue e WHERE b.idbenevole=e.idbenevole and nomactivite=''ESTIVAL SC'' ORDER BY 3,2 '),
('GS_LST_ESTIV_REF_SC', 'GS - Liste referents ESTIVAL SC', 'SELECT distinct ''X'' noprint, b.nom,b.prenom,telephone,email,sexe,datenaissance,lieunaissance,age, adresse,ville,codepostal,profession,commentaire, enquete FROM benevole_all b, engagement_vue e WHERE b.idbenevole=e.idbenevole and  nomactivite=''ESTIVAL SC''  and nomrole=''REFERENT'' ORDER BY b.prenom,b.nom '),
('GS_LST_REF_ACT', 'GS - Liste référents par activite', 'SELECT ''X'' noprint,jourdefaut "Jour",nomsite "Site",v.prenom,v.nom, telephone , email ,annee,numjoursem FROM engagement_vue v,benevole_all b WHERE v.idbenevole=b.idbenevole and v.nomrole = ''REFERENT'' and nomactivite=''P_NOMACTIVITE'' ORDER BY numjoursem,nomsite,v.prenom,v.nom'),
('GS_LST_REF_ACTIF', 'GS-Liste des référents actifs de la rue', 'SELECT distinct ''X'' noprint, b.prenom,b.nom,nomactivite,nomsite,jourdefaut,nomrole,b.telephone,b.email, annee, b.permis,b.permispl,b.autorisationconduite FROM benevole_all b, engagement_vue e where b.idbenevole =e.idbenevole and nomrole=''REFERENT'' and idactivite in (3,7,6,8,2) ORDER BY b.prenom,b.nom, nomactivite'),
('GS_MOYENNE_DISTRIB', 'GS - Moyenne hebdomadaire du nombre de bénéficiaire', 'select concat(convert(date_format(jour,''%Y''),CHAR), '' - '', convert(date_format(jour,''%u''),CHAR)) semaine, round(sum(nombre_beneficiaire)/7) moyenne from suivi_activite where idactivite=3 group by concat(convert(date_format(jour,''%Y''),CHAR), '' - '', convert(date_format(jour,''%u''),CHAR)) order by 1 desc'),
('GS_PRESENCE_7_JOURS', 'GS - Liste des benevoles presents pour une activité sur les 10 prochains jours', 'SELECT date_format(jourpresence,''%Y-%m-%d'') date, jour,nomsite,prenom,nom, nomrole,autorisationconduite,etat,case when ifnull(commentaire,'''')='''' then '' '' else replace(replace(commentaire,CHAR(10),''. ''),'','','' -'')  end commentaire FROM presence_mois WHERE etat in (''Présent'',''Absent'') and nomactivite=''P_NOMACTIVITE''    and jourpresence between  date_add(curdate(),interval -1 day) and date_add(curdate(),interval +10 day) order by 1 ,3,4'),
('GS_PRESENCE_SYN_15', 'GS - Synthèse benevoles presents sur 1 mois', 'SELECT distinct date_format(p.jourpresence,''%Y-%m-%d'') date,jour,p.nomsite ,ifnull(présent,0) présents, ifnull(référent,0) référent,ifnull(chauffeur,0) chauffeur,prevu as prévu FROM presence_mois p INNER JOIN (select idactivite,idsite,jourdefaut,count(*) prevu from engagement_vue group by idactivite,idsite,jourdefaut) e on p.idactivite=e.idactivite and p.idsite=e.idsite and p.jour=e.jourdefaut LEFT JOIN (select idactivite,idsite,jourpresence,count(*) présent from presence_mois where etat = ''Présent'' group by idactivite,idsite,jourpresence) b on p.idactivite=b.idactivite and p.idsite=b.idsite and p.jourpresence=b.jourpresence LEFT JOIN (select idactivite,idsite,jourpresence,count(*) référent from presence_mois where nomrole=''REFERENT'' and etat = ''Présent'' group by idactivite,idsite,jourpresence) r on p.idactivite=r.idactivite and p.idsite=r.idsite and p.jourpresence=r.jourpresence LEFT JOIN (select idactivite,idsite,jourpresence,count(*) chauffeur from presence_mois where autorisationconduite=''X'' and etat=''Présent'' group by idactivite,idsite,jourpresence) c on p.idactivite=c.idactivite and p.idsite=c.idsite and p.jourpresence=c.jourpresence WHERE p.nomactivite=''P_NOMACTIVITE'' and p.jourpresence between date_add(curdate(),interval -1 day) and date_add(curdate(),interval +30 day) order by 1,3'),
('GS_SUIVI_ACTIVITE', 'GS - suivi activité sur le 7 derniers jours', 'SELECT jour as date,CASE date_format(jour,''%W'') WHEN ''Monday'' THEN ''Lundi'' WHEN ''Tuesday'' THEN ''Mardi'' WHEN ''Wednesday'' THEN ''Mercredi'' WHEN ''Thursday'' THEN ''Jeudi''  WHEN ''Friday'' THEN ''Vendredi'' WHEN ''Saturday'' THEN ''Samedi'' WHEN ''Sunday'' THEN ''Dimanche'' END jour,nomsite,nombre_beneficiaire,replace(replace(commentaire,CHAR(10),''. ''),'','','' -'') commentaire FROM suivi_activite a, (select distinct nomactivite,nomsite,idactivite,idsite from engagement_vue) e WHERE  nomactivite=''P_NOMACTIVITE'' and a.idactivite=e.idactivite and a.idsite=e.idsite and jour between date_add(curdate(),interval -7 day) and date_add(curdate(),interval +1 day) order by 1 desc'),
('GS_SUIVI_BENEFICIAIRE', 'GS - suivi du nombre de bénéficiaires distribution', 'SELECT distinct a.jour,ifnull(nb1,0) ''Jules_Julien'',ifnull(nb2,0) ''Minimes'',ifnull(nb3,0) ''Raisin'',ifnull(nb4,0) ''ESGR'' FROM suivi_activite a left join (select jour,nombre_beneficiaire nb1 from suivi_activite WHERE idactivite=3 and jour <= now() and idsite=3) site1 on a.jour=site1.jour left join (select jour,nombre_beneficiaire nb2 from suivi_activite WHERE idactivite=3 and jour <= now() and idsite=4) site2 on a.jour=site2.jour left join (select jour,nombre_beneficiaire nb3 from suivi_activite WHERE idactivite=3 and jour <= now() and idsite=2) site3 on a.jour=site3.jour left join (select jour,nombre_beneficiaire nb4 from suivi_activite WHERE idactivite=3 and jour <= now() and idsite=5) site4 on a.jour=site4.jour where idactivite=3 and a.jour <= now() order by jour desc'),
('GS_SUIVI_BENEF_DDC', 'GS - Synthèse benéficiaiares DDC', 'SELECT distinct a.jour,ifnull(nbjj,'''') ''Jules_Julien'',ifnull(nbmi,'''') ''Minimes'',ifnull(nbra,'''') ''Raisin'' FROM suivi_activite a left join (select jour,nombre_beneficiaire nbjj from suivi_activite WHERE idactivite=7 and idsite=3) jj on a.jour=jj.jour left join (select jour,nombre_beneficiaire nbra from suivi_activite WHERE idactivite=7 and idsite=2) ra on a.jour=ra.jour left join (select jour,nombre_beneficiaire nbmi from suivi_activite WHERE idactivite=7 and idsite=4) mi on a.jour=mi.jour where idactivite=7 and a.jour between date_add(curdate(),interval -15 day)and curdate() order by jour desc '),
('GS_SYNTHESE_NOEL', 'GS - Synthèse benevoles noel', 'SELECT distinct date_format(p.jourpresence,''%Y-%m-%d'') date,jour, ifnull(présents_noel,0) as présents_noel ,ifnull(inscrits_noel,0) as inscrits_noel ,ifnull(présent_rdc,0) présents_RDC, ifnull(référent,0) référents_RDC FROM presence_mois p LEFT JOIN (select idactivite,jourpresence,count(*) présents_noel from presence_mois where etat = ''Présent'' and nomsite=''Bénévoles noel'' group by idactivite,jourpresence) n on p.idactivite=n.idactivite and p.jourpresence=n.jourpresence LEFT JOIN (select idactivite,jourdefaut,count(*) inscrits_noel from engagement_vue where nomsite=''Bénévoles noel'' group by idactivite,jourdefaut) i on p.idactivite=i.idactivite and p.jour=i.jourdefaut LEFT JOIN (select idactivite,jourpresence,count(*) présent_rdc from presence_mois where etat = ''Présent'' group by idactivite,jourpresence) b on p.idactivite=b.idactivite and p.jourpresence=b.jourpresence LEFT JOIN (select idactivite,jourpresence,count(*) référent from presence_mois where nomrole=''REFERENT'' and etat = ''Présent'' group by idactivite,jourpresence) r on p.idactivite=r.idactivite and p.jourpresence=r.jourpresence WHERE p.nomactivite=''Distribution'' and p.jourpresence between date_add(curdate(),interval -1 day) and str_to_date(''2022-01-03'',''%Y-%m-%d'') order by 1,3'),
('GS_SYNTHESE_RDC_NOEL', 'GS - Synthèse benevoles RDC noel', 'SELECT date_format(jourpresence,''%Y-%m-%d'') date,jour,count(*) Présents FROM presence where etat=''Présent'' and idactivite=3 and jourpresence > str_to_date(''2021-12-19'',''%Y-%m-%d'') group by date_format(jourpresence,''%Y-%m-%d''),jour order by 1'),
('GS_SYNT_RDC_NOEL', 'GS - Synthèse benevoles RDC noel', 'SELECT date_format(jourpresence,''%Y-%m-%d'') date, jour,nomsite,prenom,nom, nomrole,etat,case when ifnull(commentaire,'''')='''' then '' '' else replace(replace(commentaire,CHAR(10),''. ''),'','','' -'')  end commentaire FROM presence_mois WHERE etat in (''Présent'',''Absent'') and nomactivite=''Distribution''    and jourpresence> str_to_date(''2021-12-19'',''%Y-%m-%d'')  order by 1 ,3,4'),
('GS_SYN_BEN_ACTIF', 'GS - synthèse bénévoles actifs par activite et par jour', 'SELECT ''X'',nomactivite,numjoursem,(case jourdefaut when '''' then '' '' else jourdefaut end) jour,count(*) nombre FROM engagement_vue group by nomactivite,numjoursem,jourdefaut'),
('GS_SYN_BEN_DELETE', 'GS - Liste des benevoles supprimés depuis 1 an', 'SELECT ''X'',datemiseajour date_suppression,nom, prenom, (case ifnull(telephone,'''') when '''' then ''   '' else convert(telephone,char) end) as telephone,(case ifnull(email,'''') when '''' then ''   '' else email end) as email,ifnull((case sexe when '''' then ''  '' else sexe end),''   '') as sexe,(case ifnull(datenaissance,'''') when '''' then ''   '' else date_format(datenaissance,''%d/%m/%Y'') end) as datenaissance,(case ifnull(lieunaissance,'''') when '''' then ''   '' else lieunaissance end) as lieunaissance,ifnull((case adresse when '''' then ''   '' else adresse end),''   '') as adresse,ifnull((case ville when '''' then ''   '' else ville end),''   '') as ville,ifnull((case codepostal when '''' then ''   '' else codepostal end),''   '') as codepostal,ifnull((case profession when '''' then ''    '' else profession end),''   '') as profession,ifnull(1ereinscription,''  '') as 1ereinscription,(case ifnull(dateinscriptioncourante,'''') when '''' then ''   '' else date_format(dateinscriptioncourante,''%d/%m/%Y'') end) as dateinscriptioncourante, ifnull((case annee when '''' then ''   '' else annee end),''   '') as annee,ifnull((case contact when '''' then ''   '' else contact end),''   '') as contact\r\nFROM benevole_tbl_old WHERE datemiseajour > curdate()-365 order by datemiseajour desc '),
('GS_SYN_ENG_ACT', 'GS - Synthèse bénévoles engagements par activite', 'SELECT  ''X'' noprint,  (case jourdefaut when '''' then '' '' else jourdefaut end) "Jour",nomsite "Site",count(*) "Nombre de bénévoles",numjoursem FROM engagement_vue WHERE nomactivite=''P_NOMACTIVITE'' group by jourdefaut,numjoursem,nomsite ORDER BY numjoursem,nomsite'),
('GS_SYN_REF_ACTIF', 'GS - synthèse référents actifs par activite et par jour', 'SELECT ''X'',nomactivite,numjoursem,(case jourdefaut when '''' then '' '' else jourdefaut end) jour,count(*) nombre FROM engagement_vue where nomrole=''REFERENT'' group by nomactivite,numjoursem,jourdefaut');
