(2, 1, '2022-02-18', 350, '70 170 110. Pour vendredi et samedi. 170 et 70 pour dimanche. Vendredi il y a de tout. Samedi il manque juste les yaourts de Jules-Julien . Dimanche pas de yaourt du tout. Le reste est ok. Pain et viennoiserie dans le local vêtements pour dimanche'),
(2, 1, '2022-02-21', 350, '70 170 110. Il y a de tout mais pas de viennoiserie qui sont donc remplacées par des gâteaux (deux par personne)'),
(2, 1, '2022-02-22', 350, '70 170 110 tu as du pain au local des vêtements. Il y a quelques fruits. Il faudra peut-être faire rentrer des gâteaux. Il y a des fromages au dépôt. Bon courage'),
(2, 1, '2022-02-23', 350, '70 170 110. Tout est Ok pour ce soir. Pain, Fromage viennoiserie, fruits pour tous dans les camions. Yaourts pour Minimes et Raisins.. Pour Jules Julien 3 petits suisses/personne. Attention les laitages sont à date du jour. Veillez à utiliser les vieux sac poubelles noirs et gris avant les neufs.'),
(2, 1, '2022-02-24', 350, '70 170 110R attention ramasse date aujourd''hui et yaourts minimes également ne rien ramener pas de gerican JJ bte eau exceptionnellement bonne distribution '),
(2, 1, '2022-02-25', 350, '70 170 110. J''ai mis une feuille sous plastique avec les 3 jours expliqués, collée sur le meuble métallique '),
(2, 1, '2022-03-01', 350, '70 170 110. Yaourts fromages et beaucoup de ramasse dans la chambre froide. Petits gâteaux dans les camions. Pain sur la table. Produits bébés à distribuer aujourd''hui ( date).'),
(2, 1, '2022-03-02', 350, '70 + 170 +110 Tout est ok dans les camions. Pour les gâteaux 2 paquets de 2 gâteaux par personne. Fruits, pain, fromage, yaourt  et tout matériel fongible dans les camions. Pour le lait 2 variantes, petits pots de crème individuels ou lait en bouteille. Privilégier les petits pots.'),
(2, 1, '2022-03-03', 350, '70 110 170. Il y a de tout mais pas de viennoiserie qui sont remplacées par des gâteaux (deux par personne). Nous avons charger les camions avec de l''hygiène un sac par personne pour ce soir poisson pané flageolets aux légumes'),
(2, 1, '2022-03-04', 350, 'À partir de ce vendredi j''envoie une photo sur WhatsApp des référents rendant compte des 3 jours the weekend sans compter 3'),
(2, 1, '2022-03-07', 350, '70 170 110. Pour les yaourts un actimel par personne. Trois petits suisses par personne. Ramasse à passer impérativement aujourd''hui. Pas de viennoiserie mais de gâteau par personne voir etuve. Message aux référents sur le WhatsApp'),
(2, 1, '2022-03-08', 350, '70 170 110. Yaourts fromages et ramasse dans la chambre froide. Pain sur la table. Viennoiseries pour JJ et Raisin, 2 petits gâteaux par  personne  pour  Minimes. Menu escalope de poulet flageolet carotte'),
(2, 1, '2022-03-09', 350, '70 170 110.  Tout ok. Yaourts, pour les petits suisses 3/personne, fruits, gâteaux 2x2/personne, fromages, pains OK. Amicalement '),
(2, 1, '2022-03-10', 350, '70 170 110 Beaucoup de ramasse du jour fruits fraises 1 barquette par personne +pommes et après RAS'),
(2, 1, '2022-03-11', 350, '70 170 110'),
(2, 1, '2022-03-14', 350, '70 170 110.yaourts fromages pain fruits ok. Viennoiseries ok pour Julien et minimes. Au raisin petit gâteau et viennoiserie. J''ai mis des boîtes de chocolats à distribuer aux bénéficiaires'),
