(3, 2, '2022-05-28', 150, 'Repas apprécié. Il a manqué une dizaine de plats chauds. Nous avons donc donné des saladières  et la ramasse.'),
(3, 2, '2022-05-30', 135, 'Évitez de mettre l''eau et les bananes dans les camions quand il fait chaud!!! Pas assez de sucre ni de viennoiseries. Quelques saladieres distribuées'),
(3, 2, '2022-05-31', 150, 'Beaucoup de bénéficiaires. Plus rien (café, soupe, plats chauds) à 20h.quelques tensions dues au manque de nourriture '),
(3, 2, '2022-06-01', 160, 'Repas apprécié, beaucoup de monde, l''ambiance est restée calme.'),
(3, 2, '2022-06-02', 130, 'Pas assez de poisson, environs 30 portions manquantes.'),
(3, 2, '2022-06-03', 120, 'Soirée "orageuse " quelques nouveaux bénéficiaires ne comprennent pas que nous donnions 1 seul repas, squat livré avec plats restants,jerrican d''eau mis au frigo, étagères et plancher lessivés '),
(3, 2, '2022-06-04', 135, 'Repas apprécié. Le reste de poulet mis en barquettes a été mis dans la chambre froide pour dimanche. '),
(3, 2, '2022-06-06', 105, 'Trop de pâtes. Bonne ambiance '),
(3, 2, '2022-06-07', 120, 'Repas apprécié'),
(3, 2, '2022-06-08', 130, 'Soirée tranquille, plusieurs compliments sur la soupe! Les secours sont intervenus en début de distri car un bénéficiaire très alcoolisé avait fait une chute un peu avant qu''on arrive, avec une grosse blessure près de l''œil/tempe. Les restes ont été déposés au squatt rue Cazeneuve'),
(3, 2, '2022-06-09', 110, 'Pas assez de galette de legume.'),
(3, 2, '2022-06-10', 125, 'Nous avons du trier les bananes et poires trop abîmées, pommes données à JJ , distribution sans difficultés, riz trop cuit. Plancher et étagères lessivés. Totalité de la ramasse distribuée sur place. '),
(3, 2, '2022-06-11', 130, 'Distribution : Ras tout a été distribué. Repas apprécié. Par contre nous n’avions pas de quoi préparer de la soupe.'),
