(3, 3, '2021-12-01', 90, 'Soirée très calme, plat et soupe appréciés. 2 tickets "couches" distribués à deux familles avec enfants. L''une de ces familles, LUZI, albanaise, avec 3 enfants dont un petit de 2 ans, dort dehors depuis 13 jours avec aucune solution au 115.'),
(3, 3, '2021-12-02', 91, 'Ras. Soirée tranquille. Manque de légumes (carottes) qui ont été très appréciés.'),
(3, 3, '2021-12-03', 85, 'Des barquettes un peu plus grande si possible car difficile de faire rentrer le poisson ou la cuisse de poulet'),
(3, 3, '2021-12-04', 77, '77 repas de servis.\nTrès bonne soirée.\nRAS\nFaire le plein. '),
(3, 3, '2021-12-05', 75, '8 Bénévoles (4 nouveau bénévoles en cours d''inscription), bonne ambiance. Essence sur la réserve, nous avons pris le camion 311 des raisins. '),
(3, 3, '2021-12-06', 70, 'Peu de monde. On a déposé un plat quasi plein de petit pois et deux plats de poisson au squat de la rue roquelaine. L''aspirateur de la salle marche très mal (mais ça ne doit pas etre de notre ressort). Sinon RAS. '),
(3, 3, '2021-12-07', 76, 'RAS, on a donné les manteaux du camion a 2 personnes sans manteaux il pleuvait à verse et ils n''avaient rien pour se couvrir.'),
(3, 3, '2021-12-08', 68, 'Soirée  calme. bénéficiaires très contents de diner au chaud mais bcp dorment dehors et souffrent du froid. duvet et polaire distribués. bcp de steaks.'),
(3, 3, '2021-12-09', 59, 'RAS. Que dire de plus. '),
(3, 3, '2021-12-10', 50, '50 bénéficiaires, tout s''est bien passé. Dommage on a jeté beaucoup !'),
(3, 3, '2021-12-11', 84, 'RAS. Tout s''est bien passé. Les plats ont été appréciés.'),
(3, 3, '2021-12-12', 70, 'Très calme. Plus de plat chaud nous avons complété avec 10 salades '),
(3, 3, '2021-12-13', 72, 'RAS'),
(3, 3, '2021-12-14', 67, 'RAS, soirée très calme. On a eu du pain qu''on a mis dans la salle de prépa'),
(3, 3, '2021-12-15', 70, 'pas de couverts.. calme a part 2/3 réfractaires au masque.'),
(3, 3, '2021-12-16', 71, 'Prépa : les norvégiennes avec 100 repas sont beaucoup beaucoup trop lourdes. Sur site à 19h00. RAS. Ensuite 2 bénéficiaires sont arrivés après 20h00. A 20h15 il n''en reste plus qu''une dizaine. Nous avons rangé vers 20h35. Ne pourrait-on pas revenir à des horaires comme pour les autres sites? '),
(3, 3, '2021-12-17', 65, 'Très bonne ambiance. L''école du Fauga est venu distribuer des desserts et des boissons. Il y a eu aussi beaucoup d''autres dons qui ont été ramené à Lalande'),
(3, 3, '2021-12-18', 72, 'RAS. Plats appréciés. '),
(3, 3, '2021-12-19', 70, 'Ras'),
(3, 3, '2021-12-20', 80, 'Porte de sortie du restaurant senior verrouillé. Les doses étaient quasi parfaites, le rab de riz a été laissé rue roquelaine. La date de consommation (de préférence) de certains plats pour bébé était de octobre 2021: quand meme distribuables? '),
(3, 3, '2021-12-21', 80, 'Ras '),
(3, 3, '2021-12-22', 75, 'Soirée calme. Distribution de jouets à 3 familles (dont la famille Luzy, qui a aussi demandé des couches : un ticket remis). Visite du maire de Toulouse avec son adjoint aux solidarités Daniel Rougé, de la maire de quartier, et de l''équipe de Audrey Hernandez, accueillis par Isabelle Barthe.'),
(3, 3, '2021-12-23', 83, 'RAS. Plat chaud et bûche très appréciés. Message transmis à tous les bénéficiaires de la fermeture du site JJ à partir du 25/12 au 2/01.'),
(3, 3, '2021-12-24', 75, 'Soirée dans le calme et avec le sourire. \nNous avons laissé le jus de coco restant dans le camion (qui périme le 27) et je viens de me rappeler qu''il ne sort plus avant le 3 janvier.\n'),
(3, 3, '2022-01-02', 0, 'Jules Julien fermé '),
(3, 3, '2022-01-03', 58, 'RAS. Très calme. Un plat de steak de soja/pomme de terre/poulet + un sac de yahourts donnés au squat rue Roquelaine. '),
(3, 3, '2022-01-04', 75, '50 repas pour le site c''est un peu léger '),
(3, 3, '2022-01-05', 70, 'RAS'),
(3, 3, '2022-01-06', 65, 'Bon repas, soirée très calme !'),
(3, 3, '2022-01-07', 46, 'Trop de chaud à jeter. Dommage. Sinon comme d''habitude, bonne ambiance. Très calme'),
(3, 3, '2022-01-08', 50, 'Nous avons eu pile poil de nombre de part de tarte. RAS. '),
(3, 3, '2022-01-09', 45, '7 bénévoles - très calme et peu de monde lié sûrement à la pluie '),
(3, 3, '2022-01-10', 50, 'Rations ok. On a tout écoulé, le saumon aussi. On a eu des retours pas terribles sur le lait de coco qui aurait rendu malade certain.e.s bénéficiaires. '),
(3, 3, '2022-01-11', 55, ''),
(3, 3, '2022-01-12', 53, 'RAS soirée très calme'),
(3, 3, '2022-01-13', 45, 'RAS'),
(3, 3, '2022-01-14', 70, 'Toujours aussi calme. Bonne ambiance. On a pris la poubelle du restaurant par erreur'),
(3, 3, '2022-01-15', 56, '56 repas\nRas\nNouvelle benevole : Anastassia Glazova '),
(3, 3, '2022-01-16', 45, '7 bénévoles - distribution dans le calme - quantité suffisante '),
(3, 3, '2022-01-17', 55, 'RAS, 1 duvet donné, dommage s’il n’y ait pas eu de légumes. Il serait bien aussi d’avoir des infos de la cuisine concernant les proportions à donner (on donne peu au début par peur de manquer et on se retrouve avec un peu trop à la fin)'),
(3, 3, '2022-01-18', 55, 'Pas assez de barquettes dans le camion'),
(3, 3, '2022-01-19', 70, 'Soirée calme, plat apprécié ! Quelques cadeaux distribués mais on avait des petits garçons, et des cadeaux petites filles.. sinon pas assez de barquettes ni de couverts ni de serviettes : il faudrait prévoir une marge à au moins 70 ! '),
(3, 3, '2022-01-20', 62, 'RAS. '),
(3, 3, '2022-01-21', 70, 'Comme d''habitude, bonne ambiance. Quelques cadeaux distribués. '),
(3, 3, '2022-01-22', 51, 'RAS. Bonne ambiance. Menu apprécié.'),
(3, 3, '2022-01-23', 61, 'RAS très calme '),
(3, 3, '2022-01-24', 78, 'Pas assez de purée, ni de café. Un sac de couchage donné '),
(3, 3, '2022-01-25', 60, 'RAS, merci d''écrire les site au lieu de "moyen poulet" sur les norvégiennes. Température prise avant distri mais pas de stylo, 68°'),
(3, 3, '2022-01-26', 73, 'RAS, distribution sereine. 1 ticket vêtements.'),
(3, 3, '2022-01-27', 75, 'Bonne soirée, repas apprécié. '),
(3, 3, '2022-01-28', 60, 'Soirée calme. Galère pour nettoyer la cuisine avec une seule raclette dont le manche est cassé'),
(3, 3, '2022-01-29', 8, '56 repas de servis.\nRAS\n\nIl manque une serpillière pour nettoyer la cuisine.\n\n +Masha, bénévole non inscrite sur la base de donné mais qui vient régulièrement. '),
(3, 3, '2022-01-30', 65, '7 bénévoles - quantité suffisante - rideau fer sortie de la salle en panne déjà signalé - bonne ambiance'),
(3, 3, '2022-01-31', 57, 'Ras, ambiance calme, plusieurs parkas et chaussettes données '),
(3, 3, '2022-02-01', 60, 'La salle était ouverte quand nous somme arrives '),
(3, 3, '2022-02-02', 74, 'RAS soirée très calme'),
(3, 3, '2022-02-03', 70, ''),
(3, 3, '2022-02-04', 65, 'Soirée calme. Fuites dans la salle de prépa du café sous l''évier et au niveau du tuyau d''eau chaude. Il manque régulièrement le petit balais dans la salle de JJ. '),
(3, 3, '2022-02-06', 47, 'Bonne ambiance repas apprécié '),
(3, 3, '2022-02-07', 55, 'Thermomètre sans piles! RAS'),
(3, 3, '2022-02-08', 63, 'Une personne garée sur la place réservée aux restos'),
(3, 3, '2022-02-09', 62, 'Distribution calme, à part les 3 petits garçons qui sautent partout dans le restaurant :). Le surplus de plat chaud a été apporté au squat 5 rue d''Alès. 4 tickets vêtements distribués (dont 3 à des ukrainiens, orthographe du nom pas garantie), plus des parkas. Il faudrait remplacer la balayette ...'),
(3, 3, '2022-02-10', 70, 'Ras.'),
(3, 3, '2022-02-11', 70, 'Comme d''habitude, bonne ambiance.'),
(3, 3, '2022-02-12', 47, 'RAS\nRepas très apprécié '),
(3, 3, '2022-02-13', 50, 'Très calme poisson apprécié '),
(3, 3, '2022-02-14', 60, '50 repas complets, manque de boulgours pour les autres. '),
(3, 3, '2022-02-15', 60, ''),
(3, 3, '2022-02-16', 65, 'Disribution calme. \nPas assez de lentilles et trop de saucisses. Ce serait top d''avoir un ordre d''idée du nb de saucisses pour que l''on équilibre les barquettes.  Merci'),
(3, 3, '2022-02-17', 62, 'RAS pour la distri. Mais manque pelle et balai. A 20h15 le dernier bénéficiaire. Départ à 20h30.'),
(3, 3, '2022-02-18', 70, 'Soirée calme. Pas de pelle à JJ ni dans le camion.'),
(3, 3, '2022-02-19', 60, 'Tout s''est bien passé.'),
(3, 3, '2022-02-20', 60, '7 bénévoles, quantité suffisante, bonne ambiance, manche du grand balai dans la salle JJ cassé, plus de pelle disponible. '),
(3, 3, '2022-02-21', 61, 'Il manque une table dans le camion de JJ. Distribution calme et bonne ambiance, 1 sac de couchage, 1 parka et 1 polaire donnés '),
(3, 3, '2022-02-22', 50, ''),
(3, 3, '2022-02-23', 87, 'Soirée calme à part une bénéficiaire qui haranguait d''autres groupes.  On a heureusement réussi grâce à l''équipe à la calmer. Sinon  plus de manche sur le grand balais, pas pratique....on a distribué tous les petits suisses et la ramasse.merci a la prepa et la cuisine '),
(3, 3, '2022-02-24', 69, 'Grand balai cassé. Pas de pelle. '),
(3, 3, '2022-02-25', 75, 'Soirée calme'),
(3, 3, '2022-02-26', 56, 'Menu apprécié. Bonne ambiance. '),
(3, 3, '2022-02-27', 76, 'Pas assez de plats chauds, une dizaine de salades conserves distribuées. '),
(3, 3, '2022-02-28', 75, 'Pas assez de barquettes et couverts, ramasse et restes donnés a un squat'),
(3, 3, '2022-03-01', 48, 'Plat moyennement apprécié'),
(3, 3, '2022-03-02', 78, 'Soirée calme. Une dizaine de barquettes parties au squat Babinet.'),
(3, 3, '2022-03-03', 65, 'Soirée calme, bon repas. Les sachets de produits d’hygiène ont été très appréciés. Mais nous avons été surpris de les voir ds les camions, car nous n’avons pas été prévenus ! A refaire, c’est très bien.  Merci. PHenri. '),
(3, 3, '2022-03-04', 50, 'Nous avons innové ce soir à cause de la pluie et servi la soupe et le café à l''intérieur. Nous avons jeté les 3/4 des endives car pas appréciées.'),
(3, 3, '2022-03-05', 48, 'Bonne ambiance. RAS. '),
(3, 3, '2022-03-06', 50, 'Soirée calme, assez de tout, pain frais laissé a Lalande pour demain '),
(3, 3, '2022-03-07', 55, 'Une autre paire de gants pour l''étuve ça serait plus pratique. RAS distrib. '),
(3, 3, '2022-03-08', 40, 'Grosse averse, peu de gens pas couverts, beaucoup de vêtements et ponchos demandés. Merci de faire le plein et mettre des duvets dans les camions '),
(3, 3, '2022-03-09', 55, 'Poisson et écrasée de pdt très appréciés ! mais pas tout à fait assez de pdt. Le bénéficiaire qui avait oublié son téléphone et son chargeur dans la salle lundi a été ravi de les retrouver ce soir. Ambiance très tranquille.'),
(3, 3, '2022-03-10', 51, 'RAS. Tout à été distribué.'),
(3, 3, '2022-03-11', 60, 'Distribution calme-Repas apprécié. Tout a été distribué. Difficile de rendre la cuisine propre sans serpillière et avec une raclette cassée.'),
(3, 3, '2022-03-12', 48, 'RAS\nTrès bonne ambiance\nGuillaume, un bénévole en plus. '),
(3, 3, '2022-03-13', 57, 'RAS'),
(3, 3, '2022-03-14', 60, '10/15 plats sans haricots. Retour des enfoiros apprécié. '),
(3, 3, '2022-03-15', 65, 'Quelques nouveaux bénéficiaires distri calme'),
(3, 3, '2022-03-16', 66, 'Soirée calme. Plat très apprécié ! Plusieurs polaires distribuées. '),
(3, 3, '2022-03-17', 52, 'Repas très apprécié sinon RAS. Les raclettes pour la cuisine sont en très très mauvais état. '),
(3, 3, '2022-03-18', 65, 'Bonne ambiance. Nous avons rempli quelques questionnaires. Très bien fait. Pour les bénéficiaires ne parlant pas bien  français certaines questions sont plus compliquées. '),
(3, 3, '2022-03-19', 70, 'Bonne ambiance. Menu très apprécié.'),
(3, 3, '2022-03-20', 75, 'Un peu juste en plat chaud nous avons chauffé des pâtes qui étaient dans la chambre froide ils ont apprécié '),
(3, 3, '2022-03-21', 75, 'Manque de riz. '),
(3, 3, '2022-03-22', 65, 'Plats très appréciés'),
(3, 3, '2022-03-23', 66, 'Soirée sereine. Visite de Carole, du Réseau AN Rue. Plats chauds et desserts préparés par le lycée pro R Bonnet très appréciés (surtout le dessert !). 5 ou 6 questionnaires remplis. Petit souci : des vols ont été signalés par le club senior sur des objets laissés dans le restaurant .. '),
(3, 3, '2022-03-24', 70, 'RAS. Très bonne soirée. Plat très apprécié.'),
(3, 3, '2022-03-25', 90, 'Comme d''habitude, bonne ambiance. Par contre beaucoup de monde. On a dû taper dans les saladettes'),
(3, 3, '2022-03-26', 79, 'Ras\nDes bénéficiaires Ukrainiens\nIl faudrait des couches taille 5 pour JJ dimanche \n + Rebecca et Baptiste bénévoles d''un jour'),
(3, 3, '2022-03-27', 76, '6 bénévoles, quantité suffisante, chariot de viennoiserie laissé dans le local a vêtement car énorme quantité/besoins'),
(3, 3, '2022-03-28', 85, 'Pas assez de sucre. Un sac de yahourts en trop. Peut être trouver une pelle et un balai en meilleur état. Moins de chou fleur que du reste. '),
(3, 3, '2022-03-29', 85, 'Un jeune couple Alexandro et Kaina souhaiteraient une couverture vivent en tente au bord du canal . distribution très calme plat apprécié un peu plus de monde .manque de couverts '),
(3, 3, '2022-03-30', 85, 'Beaucoup de monde, les 5 derniers ont eu des saladières. Bagarre dans le restaurant : gobelet de soupe lancé par un bénéficiaire sur un autre (tachant le mur du fond et le plafond), puis les deux se sont battus. Heureusement plusieurs bénéficiaires se sont interposés, on a fermé en avance (20h15)'),
(3, 3, '2022-03-31', 95, 'Tout à été distribué. Pas assez de tout. '),
(3, 3, '2022-04-01', 89, 'Comme d''habitude, très bonne ambiance '),
(3, 3, '2022-04-02', 57, 'RAS. Bonne ambiance.'),
(3, 3, '2022-04-03', 72, 'Quantité plats insuffisante: une grosse dizaine de saladières distribuées.  Bonne ambiance, manque la pelle dans la salle JJ, restaurant ouvert à notre arrivée. '),
(3, 3, '2022-04-04', 75, 'Ras '),
(3, 3, '2022-04-05', 65, 'Tension entre bénéficiaires en début de distri .entre 2 hommes puis à une autre table,toujours la même bénéficiaire qui insulte son voisin de table... Camion en panne'),
(3, 3, '2022-04-06', 61, 'Soirée calme, peu de monde. Antony (l''homme du jet de soupe) était là, un peu surex mais gentil. On lui a donné une polaire pour son boulot qui commence demain. 6 questionnaires remplis. Plat très apprécié ! merci aux cuisinier-e-s. 6 barquettes au squat rue d''Alès.'),
(3, 3, '2022-04-07', 51, 'Très très calme. Ras.'),
(3, 3, '2022-04-08', 70, 'RAS'),
(3, 3, '2022-04-09', 57, 'RAS'),
(3, 3, '2022-04-10', 55, 'Soirée très très calme - RAS'),
(3, 3, '2022-04-11', 60, 'Soupe un peu fade selon les bénéficiaires, sinon RAS  '),
(3, 3, '2022-04-12', 55, 'Ras, bonne distribution présence enfoiros'),
(3, 3, '2022-04-13', 60, 'Distribution très calme. Plat très apprécié par les bénéficiaires. Merci les cuistots!! 3 enquêtes remplies. 3 anoraks fournis.Assira des achats aux restos national nous a bien aidé et on a échangé. '),
(3, 3, '2022-04-14', 52, 'Gastro avec les flageolets vraiment trop trop pleine. C''est très lourd et ça déborde. A notre arrivée les tables de la salle étaient quasiment toutes sales et le sol non balayé. Le sac à dos bleu a été remis à son propriétaire.  3 polaires et un duvet distribués. Tout a été distribué sur le site.Ii'),
(3, 3, '2022-04-15', 50, 'Repas moins apprécié ce soir. Apparemment problème dans la répartion des repas entre les 3 sites.'),
(3, 3, '2022-04-16', 46, 'Ras\n+ Rebecca bénévole renfort '),
(3, 3, '2022-04-17', 60, '53 parts + 7 salades fraîches.Une voiture nous a renversé la soupe en partant…'),
(3, 3, '2022-04-18', 65, 'RAS'),
(3, 3, '2022-04-19', 70, 'Manque de barquettes, les portions étaient copieuses. Distribution calme, on a distribué a l''intérieur car pas de parapluie, très apprécié par les bénévoles '),
(3, 3, '2022-04-20', 62, 'Soirée très calme. Visite de M Standarovski et C Loudier qui travaillent sur le projet de pôle d’innovation sociale de la ville de Toulouse. Plainte du club senior sur l''état des toilettes lundi matin.'),
(3, 3, '2022-04-21', 55, 'Soirée très calme, repas très apprécié. ');
INSERT INTO suivi_activite (idactivite, idsite, jour, nombre_beneficiaire, commentaire) VALUES
(3, 3, '2022-04-22', 70, 'Pas assez de quiche. Sinon très bien '),
(3, 3, '2022-04-23', 46, 'Ras\n+Rebecca et Mathis bénévoles renfort'),
(3, 3, '2022-04-24', 50, 'RAS ( en même temps c’est les élections…. )'),
(3, 3, '2022-04-25', 75, 'Il nous manquait au moins une vingtaine de repas, nous avons rationalisé les portions pour pouvoir en donner a tout le monde. Nous avons également manqué de yaourt et de fromages. nous avons tout distribué ainsi que la totalité des sandwich, salade etc.\nAmbiance générale bonne\n'),
(3, 3, '2022-04-26', 60, 'Distri très calme plats appréciés '),
(3, 3, '2022-04-27', 65, 'Soirée très sympa, bonne ambiance. Le chili con carne a été très apprécié : bravo aux cuisiniers ! \nCe serait bien d''avoir un peu de marge par rapport au nombre de bénéficiaires attendus : c''est ok pour les barquettes (70) mais nous avons manqué de couverts/serviette, et de sucre. Merci !'),
(3, 3, '2022-04-28', 61, 'Plats appréciés. RAS pour la distribution. Porte ARG toujours aussi difficile à ouvrir.'),
(3, 3, '2022-04-29', 65, 'Soirée calme. Repas moyen un peu sec.'),
(3, 3, '2022-04-30', 51, 'Hormis la grosse bagarre du début, Ras.Il manquait 1 table. Nous en avions que 3!?\nDes tensions se sont installés entre boulistes et bénéficiaires. \nÀ surveillé......... \nLes bénévoles ont été choqués '),
(3, 3, '2022-05-02', 60, 'RAS, porte gauche du camion HS'),
(3, 3, '2022-05-03', 75, 'Ambiance très cool, plat très apprécié. La police n''est pas venue'),
(3, 3, '2022-05-04', 88, 'Soirée calme. De nouveaux arrivants de Géorgie (2 couples). Beaucoup de monde et pas de marge (fromage, yaourts, ramasse..) Discussion avec le président du club de boulistes. Pas vu la police municipale. '),
(3, 3, '2022-05-05', 71, 'Soirée calme. Manque de bon balai pour bien nettoyeur la salle. Plat très apprécié. '),
(3, 3, '2022-05-06', 63, 'Ratatouille un peu juste en quantité. Le reste ok. Bisous !'),
(3, 3, '2022-05-07', 50, 'RAS. La distribution s''est effectuée dans le calme.'),
(3, 3, '2022-05-08', 54, 'RAS le poisson est apprécié toujours pas de clef pour l’autre porte..très calme ce soir '),
(3, 3, '2022-05-09', 60, 'Seulement 40 plats avec poisson. Peu de café. Balai et pelle peu adapté.e.s.'),
(3, 3, '2022-05-10', 50, 'Ambiance très calme plat apprécié'),
(3, 3, '2022-05-11', 55, 'Soirée très calme avec peu de monde. Le poulet aux légumes a été vraiment très apprécié : bravo la cuisine ! La tente pour Erno est tjrs dans le camion ...'),
(3, 3, '2022-05-12', 65, 'La moitié  des fraises à été jetée. Plat apprécié \n Sinon ras.'),
(3, 3, '2022-05-13', 66, 'Tout s''est bien passé '),
(3, 3, '2022-05-14', 54, 'RAS'),
(3, 3, '2022-05-15', 56, 'Très très calme - trop en quantité pour tout - mécanisme porte camion arrière cassé - poisson très apprécié '),
(3, 3, '2022-05-16', 81, 'Repas apprécié ! Par contre pas assez de yahourts et de fromages'),
(3, 3, '2022-05-17', 75, 'Hachis apprécié par contre les saladieres auraient dû être placées ds la chambre froide car tièdes de même que jerrican d eau\nAmbiance calme'),
(3, 3, '2022-05-18', 47, 'Peu de monde, soirée très calme. Pas suffisamment de couverts : merci de prévoir 70 couverts + un peu de marge. Ne pas oublier de placer le jerrican d’eau en chambre froide. À nouveau la cuisine a fait très fort : poulet curry très apprécié ! Merci !'),
(3, 3, '2022-05-19', 88, 'Pas assez de plat chaud. Les jerricans d''eau sont dans la chambre froide..'),
(3, 3, '2022-05-20', 95, 'Beaucoup de monde ce soir. Nous avons complété avec la ramasse et des saladettes. Une journaliste de 20 mn est venue voir la distribution.'),
(3, 3, '2022-05-21', 71, 'Plus de monde que habituellement '),
(3, 3, '2022-05-22', 90, 'Beaucoup de monde, pas assez de plats chauds ni de laitage. Bonne ambiance '),
(3, 3, '2022-05-23', 106, 'Plus de bénéficiaires que prévu, au niveau quantité de nourriture on était presque bons mais les barquettes ont manqué. De manière générale en plus s’adapter les quantités,il nous faudrait une petite de café en plus, une petite pour 80 ce n’est pas assez. Repas végétarien apprécié '),
(3, 3, '2022-05-24', 90, 'Beaucoup de monde, pas assez de couverts... On a du aller en urgence. Plat très apprécié '),
(3, 3, '2022-05-25', 85, 'Beaucoup de monde, des personnes nouvelles dont un homme, assez jeune, en détresse, signalé aux DDC. Repas apprécié ! Mais on réclame aussi du poulet.. il faudrait aussi mettre plus de sucre pour ne pas rationner et créer des tensions inutiles. Merci !'),
(3, 3, '2022-05-26', 95, 'Ras. Repas apprécié. Le second portail ne ferme plus.'),
(3, 3, '2022-05-27', 90, 'Très bonne ambiance. Repas apprécié. Nous avons manqué de portions par contre.On a fini avec les saladettes '),
(3, 3, '2022-05-28', 70, 'RAS '),
(3, 3, '2022-05-29', 83, 'Tout juste assez de plats chauds, bonne ambiance. Pas de fuite du camion retrouvée'),
(3, 3, '2022-05-30', 110, 'Beaucoup de beneficiaire ce soir, il manquait du café, du lait et des serviettes.\nLe repas a été apprécié, bonne ambiance générale '),
(3, 3, '2022-05-31', 90, 'Plats appréciés distri calme Marcel en forme un bénéficiaire ( habillé en treillis) s est fait volé sa trottinette électrique alors qu il était ds la salle'),
(3, 3, '2022-06-01', 75, 'Distribution calme avec bcp de nouveaux.  Plat très apprécié ainsi que l''''option végétarien.'),
(3, 3, '2022-06-02', 92, 'Manque d''une quinzaine de parts du plat poisson pané, de fruits et de yaourt. Distribution de la ramasse. Sinon RAS.'),
(3, 3, '2022-06-03', 85, 'Ras'),
(3, 3, '2022-06-05', 58, 'Peu de monde, soirée calme, RAS, un grand merci a Florence et Guillaume (équipe du vendredi) pour leur aide'),
(3, 3, '2022-06-06', 76, 'Pas de plat chaud préparé pour JJ, distribution salades en boîte, pain, fromage, fruit et viennoiseries '),
(3, 3, '2022-06-07', 80, 'Distri calme'),
(3, 3, '2022-06-08', 69, 'Soirée calme. Les gens du club senior nous transmettent un message des équipes du restaurant : ne pas utiliser de produit pour nettoyer les tables, uniquement de l''eau (sinon ça reste collant le matin). Demande d''aide des DDC pour une personne accueillie (Christian). '),
(3, 3, '2022-06-09', 73, 'RAS.  Galettes de légumes appréciées.'),
(3, 3, '2022-06-10', 80, 'Repas apprécié. Nous avons eu un problème avec le.volet roulant de la porte de droite'),
