(3, 4, '2021-12-03', 170, 'chips et limonade appréciés. Tout le chaud a été distribué. Un bénéficiaire alcoolisé est tombé et malgré ses blessures (nez et front ensanglantés) n''a pas voulu que l''on appelle les urgences médicales.'),
