(3, 4, '2021-12-05', 150, 'RaS'),
(3, 4, '2021-12-06', 130, 'Bonne ambiance peu de monde, rab plats chaud resservie sur place, on a oublié de distribuer les gâteaux fourrés, pas assez de sucre, pas assez liquide nettoyage, chips et Covid compliqué à distribuer ? 1 chaussettes, 1 couverture, 1 veste , 1 sac couchage donné kit camion + 4 tickets vetements.'),
(3, 4, '2021-12-07', 150, 'Plat très apprécié et appétissant. Par contre il a été difficile d''attribuer les norvégiennes à chaque site : aucune info dessus, une norvégienne ne contenait que de la viande.'),
(3, 4, '2021-12-08', 150, 'Bonne ambiance malgré la pluie. Riz réussi ce soir. Trop de nourriture par rapport au nombre de barquettes.'),
(3, 4, '2021-12-09', 226, 'RAS'),
(3, 4, '2021-12-10', 155, 'Distribution calme. 1 ticket vêtement donné.. tout le chaud a été distribué. même si les endives n''ont pas été appréciées. La maraude nous a  apporté du pain que nous avons laissé dans des sacs à pain sur la table du bungalow.  Une bouilloire toujours en panne.'),
(3, 4, '2021-12-11', 151, 'Bonne distribution - Repas apprécié - Il faudrait avoir à disposition des éponges et balais pour la vaisselle et le nettoyage de la cuisine. Pas évident de faire la vaisselle avec une demi éponge et nettoyer le sol avec un balai à 2 franges... Penser à rajouter MOUCTAR sur la liste des bénévoles'),
(3, 4, '2021-12-12', 150, ''),
(3, 4, '2021-12-13', 140, 'Bonne ambiance peu de monde rab plats chauds reservie sur place. Tickets vetements, 1 chaussettes, 1 couverture, 1 sac couchage donnés. Pile thermomètre cuisine a vérifier peut être car s allumait et s éteignait à l utilisation.'),
(3, 4, '2021-12-14', 160, '10 bénévoles (merci à Raphaëlle de JJ).\nBonne ambiance,  5 tickets vêtements.\nRécupéré d''une dame en fin de distrib :\n- 80 btles d''eau 50 cl laissées dans le camion Minimes. \n- une vingtaine de poches de 10 pains au lait ainsi que des sucettes en chocolats laissées sur la table dans le bungalow. '),
(3, 4, '2021-12-15', 200, 'Distribution dans une bonne ambiance. '),
(3, 4, '2021-12-16', 170, 'Ras'),
(3, 4, '2021-12-17', 160, 'Les plats chauds ont été appréciés et ont été entièrement distribués  Le reste de la ramasse a été apporté dans un squat.'),
(3, 4, '2021-12-18', 150, ''),
(3, 4, '2021-12-19', 170, 'Pas de cde de pain 7 bénévoles RAS '),
(3, 4, '2021-12-20', 170, 'Bonne ambiance , rab reservie sur place excepté 1 boite croissant et quelques bananes moches ramenées, 2 tickets vetements, 1 chaussettes, 1 couverture survie kit camion donnés, merci pour le kit vaisselle, le camion a eu eu du mal a démarrer mais démarré qd mm.. batterie et froid a surveiller.'),
(3, 4, '2021-12-21', 170, 'Distribution calme, 1 ticket vêtements 1 duvet distribués. 3 bénévoles de Noël.'),
(3, 4, '2021-12-22', 180, 'Bonne distribution. Par contre il faut augmenter la quantité de légumes lorsqu''on propose de la viande hachée.  \nLa soupe est toujours aussi appréciée.  Bravo !'),
(3, 4, '2021-12-23', 170, '9 benevoles.  Repas apprécié.  Tout s''est bien passé. '),
(3, 4, '2021-12-24', 170, 'Il n''y avait ni couverts ni serviette dans le camion ce qui a retardé un peu le commencement de la distri. Sinon excellente ambiance'),
