(3, 4, '2021-12-26', 190, 'Pas de soupe 9 bénévoles RAS '),
(3, 4, '2021-12-27', 200, 'Bonne ambiance, rab reservie sur site, 3 tickets vetements, 1 gants 1 bonnet 1 calecon 1 duvet stock camion, manquait quatrième table camion'),
(3, 4, '2021-12-28', 250, 'Haricots et poulet très appréciés. 2 tickets vêtements distribués.'),
(3, 4, '2021-12-30', 170, 'Merci aux bénévoles d’un soir (3) + 1 bénévole du raisin '),
(3, 4, '2021-12-31', 160, '1 duvet donné à une personne qui dort dehors. Bonne ambiance.'),
