(3, 4, '2022-01-03', 170, 'Bonne ambiance, 1 ticket vêtements donné, rab plats chauds reservie sur place'),
(3, 4, '2022-01-04', 170, '1 sac de couchage et 2 couvertures données, 4 tickets vêtements distribués. Poisson-riz très appréciés.'),
