(3, 4, '2022-01-11', 170, 'Distribution calme. Manque de lait. La porte arrière du camion s''ouvre de plus en plus souvent. 3 tickets vêtements distribués.'),
(3, 4, '2022-01-12', 200, 'Ras'),
(3, 4, '2022-01-13', 150, 'Tout c''est bien passé.'),
(3, 4, '2022-01-14', 150, 'Les carottes rappées ont été très appréciées. Le reste des plats chauds a été apporté dans un squat. Ambiance très calme. \nUne estrade et des barrières étaient sur la place : Evènement à venir ce week-end?'),
(3, 4, '2022-01-15', 175, 'Distribution fortement perturbée par deux bénéficiaires très alcoolisés. Intervention de la police municipale.'),
