(3, 4, '2022-01-17', 160, 'Bonne ambiance excepté 1 bénéficiaire désagréable, 1 ticket vêtement donné, quelques gants, chaussettes, bonnets, écharpes stock camion, rab plats chauds resservis sur place, reste fruits, yaourts, compotes, fromages gâteau ramené Lalande.'),
(3, 4, '2022-01-18', 120, 'Soupe très appréciée. Peu de monde, rab resservi sur place. 1 ticket vêtement distribué, 1 sac de couchage et 2 couvertures distribuées. Pas de touillettes, un seul sac poubelle de la mairie.'),
(3, 4, '2022-01-19', 200, 'Atte.tion le camion n''a pratiquement plus de batterie. Nous avons du le pousser pour repartir.\nBonne distribution avec heureusement des haricots et du poisson du raisin'),
(3, 4, '2022-01-20', 150, 'Ras. Repas apprécié '),
(3, 4, '2022-01-21', 148, 'Heureusement qu''il n''y avait que 145 bénéficiaires, il a manqué 5 parts de poisson, toute la purée a été distribuée. Seules les endives ont été resservies.  Nous n''avons pris les cadeaux par peur de créer des tensions. Nous les avons laissé dans le BBR.'),
