(3, 4, '2022-01-23', 170, '7 bénévoles RAS'),
(3, 4, '2022-01-24', 168, 'Bonne ambiance, pas assez de plats chauds pour 170 annoncés...130 servis + 38 saladettes de secours, pas assez de café, soupe trop épicé dixit les bénéficiaires, duvet couvertures chaussettes caleçons écharpes  gants bonnets stock camion distribués.'),
(3, 4, '2022-01-25', 170, 'Bonne ambiance,  tout a été distribué, quantités impeccable aujourd''hui. 2 tickets vêtements,  2 couvertures, 2 Parkas, 3 caleçons. Norvégiennes tjrs aussi mal identifiées .... '),
(3, 4, '2022-01-26', 175, 'Distribution très fluide. Prévoir qq yaourts, fromages et couverts de plus...'),
(3, 4, '2022-01-27', 180, ''),
(3, 4, '2022-01-28', 180, 'Déséquilibre entre lentilles et légumes.il manquait au moins 1 plat de lentilles. 10 boîtes de thon distribuées pour compléter les repas manquant. Sinon bonne ambiance. 3 tickets vêtements distribués.'),
(3, 4, '2022-01-30', 180, '8 bénévoles RAS Philippe plus de soupe n''y de lait '),
(3, 4, '2022-01-31', 190, 'Bonne ambiance, affluence en continue, 10 saladette données en plus, 3 tickets vetements, 1 veste + qqs chaussettes bonnets gants stoc camion donnés, manquait sel en prepa camion.'),
(3, 4, '2022-02-01', 180, 'On a eu du mal à dire de quoi étaient faits les steaks (poulet, veau ?) On a mis du pain frais dans le bungalow et des pizzas dans le chambre froide : cadeau de la boulangerie de Saint Alban et de la maraude. 1 ticket vêtement distribué.'),
(3, 4, '2022-02-02', 180, 'Pas assez de semoule...'),
(3, 4, '2022-02-04', 165, 'Beaucoup trop de pates : 4 bacs , c''était beaucoup trop. Les friands ont été très appréciés.'),
