(3, 4, '2022-02-13', 160, 'RAS un monsieur viendra vs voir aux minimes sont nom Jillali Said pour des vêtements '),
(3, 4, '2022-02-14', 130, 'Bonne ambiance peu de monde ( mauvais temps + station métro Minimes fermé ? ) , pas assez de sucre, Rab plats chauds reservis sur place, 2 tickets vetements, 1 chaussettes 2 imperméable stock camion donnés.'),
(3, 4, '2022-02-15', 150, 'Un sac de pain et des sandwichs rapportés par la maraude : sandwichs distribués sur site, pain laisse dans le bungalow. Plat chaud apprécié, dommage que les haricots verts aient été mis dans une seule norvégienne (celle qu''on a ouvert en deuxième pas de bol )'),
