(3, 4, '2022-02-28', 150, 'Bonne ambiance, reste yaourts et ramasse livré squat rue Babinet.1 paire de gants stock camion.'),
(3, 4, '2022-03-01', 160, 'Bonne ambiance, plat apprécié. Toute la ramasse distribuée, ainsi que qques vêtements. Pas trouvé la feuille de relevés de température pour mars. '),
(3, 4, '2022-03-02', 150, 'Distri calme sous la pluie\nPlat chaud terminé en don\n3 personnes sont venues pour vêtement sans info plus de bons retrait ils doivent repasser au camion demain voir pour don sur place duvet caleçon et pantalon\n'),
(3, 4, '2022-03-03', 190, 'Le métro a réouvert, du monde en plus à prévoir. Pas de gobelet dans le camion nous avons du faire un aller retour en voiture pour aller les chercher. Que devions nous faire des 9 cagettes de produits d’hygiène ??'),
(3, 4, '2022-03-04', 140, 'Manque de poisson par rapport aux accompagnements. Sinon bonne ambiance RAS.'),
(3, 4, '2022-03-05', 110, 'Distribution très calme. RAS\nPar contre, les plats étaient à peine chauds pour le Site des Minimes !?'),
(3, 4, '2022-03-06', 120, 'RAS'),
(3, 4, '2022-03-07', 130, 'Bonne ambiance, plats chauds yaourts ramasse reservie sur site et livré squat rue Babinet. Compliment des bénéficiaies pr soupe et chilli.'),
(3, 4, '2022-03-08', 120, '2 poches de pain apportées par la maraude et déposées dans le bungalow. Un bénéficiaire régulier alcoolisé a renversé un autre bénéficiaire : ça a créé un peu de tension. Le plat chaud avait l''air bien bon. Plusieurs ponchos de pluie distribués.'),
(3, 4, '2022-03-09', 170, 'Repas très apprécié.  Dommage nous avons manqué de pommes de terre...\nIl n''y avait plus de produit vaisselle dans l''évier. '),
