(3, 4, '2022-03-12', 160, 'Bonne distri. RAS'),
(3, 4, '2022-03-13', 140, 'RAS dimanche prochain on ajoutera 2 gastros de poisson aux minimes c était trop juste'),
(3, 4, '2022-03-14', 140, 'Bonne ambiance, rab plats chauds viennoiseries reservie sur site et squat Mirail, quelques vetements et duvet stock camion distribués.'),
(3, 4, '2022-03-15', 150, 'Soirée calme. La sauce avait l''air très bonne. Merci pour l étiquetage des plats et norvégienne. Une bénéficiaire a oublié une poche blanche avec des écharpes dedans : on l''a laissée dans le camion. Les restes des Raisins ont été apportés au campement des albanais en face de l''île du Ramier'),
(3, 4, '2022-03-16', 175, 'Bonne distribution dans le calme avec des arrivées très échelonnées.'),
(3, 4, '2022-03-17', 140, 'RAS '),
(3, 4, '2022-03-18', 155, 'Ambiance calme, sereine. Tous les plats ont été distribués. Les feuilletés au chèvre ont été très appréciés. Serait-il possible d''enlever les palettes qui gênent les camions pour accéder à la cuisine?'),
(3, 4, '2022-03-19', 180, 'Bonne distri dans le calme. Par contre plus de batterie sur le camion au départ de Lalande. Merci Philippe pour ton intervention avec les câbles. En reculant le camion stationné côté citerne, j''ai heurté le toit, ce qui a fait exploser la vitre arrière de la porte droite. Désolée pour cet incident.'),
(3, 4, '2022-03-20', 170, '6 bénévoles RAS le pain sur la table du jour et 4 cartons retour de collecte du lidlmanque de chaud (petite erreur de la prépa)feu arrière défectueux 311 avons terminé les pâtes hier soir '),
(3, 4, '2022-03-21', 160, 'Bonne ambiance, restes plats chauds viennoiseries yaourts redistribués sur site + squat rue babinet ramasse aussi, 2 duvets et veste M distribues. Sugestion : estimation cuisine des quantités viande par portions si possible ? Ce soir c était nuggets de poisson..3...4...5...combien par pers par ex.'),
(3, 4, '2022-03-22', 165, 'Présence des Enfoiros, bonne ambiance, plat chaud très apprécié.165 barquettes servie (dont xx sans poulet), dosage ok. Ramasse au 22/03 distribuée, celle au 23/03 rapportée ainsi que 2 sacs de pain maraude. Camion trouvé avec vitre porte ar cassée.'),
(3, 4, '2022-03-23', 185, '180 barquettes du lycée bonnet + 5 personnes qui ont reçu des saladieres. \nDistribution dans le calme. '),
(3, 4, '2022-03-24', 170, ''),
(3, 4, '2022-03-25', 150, 'Ambiance calme . Tous les plats chauds ont été distribués. La ramasse a été portée à un squat.'),
(3, 4, '2022-03-26', 180, 'Bonne distri. RAS\n'),
(3, 4, '2022-03-27', 170, 'Nous avons terminé avec les sandwichs et salades. \n150 repas environs avec le gratin. \nVéronique,Thierry, Alain.\n'),
