(3, 4, '2022-03-29', 180, 'Plat très apprécié, en quantité suffisante. Il reste très peu de gel dans le camion. Un seul bénéficiaire interviewé :(.'),
(3, 4, '2022-03-30', 180, 'Problème avec les norvégiennes : les plats de lentilles étaient trop remplis, ils étaient trop lourds et ont débordé dans les norvégiennes.'),
