(3, 4, '2022-04-30', 170, 'Bonne distri\nRas'),
(3, 4, '2022-05-01', 160, 'Distribution bien passée. Quelques nouvelles personnes sûrement de JJ.\nVéronique, Thierry et Alain .'),
(3, 4, '2022-05-02', 175, 'Bonne ambiance + de monde  fin de mois, fin ramadan, pas assez couvert serviette du coup, ramasse sur site, gastro avec que p sauce sans œufs pas évident prdistribution (requêtes quantités viande, poison, oeuf estimés/ pers à distribuer svp)bpas assez café avec 1  contenaire, fromages oubliés dépot'),
(3, 4, '2022-05-03', 190, 'Plat chaud très appétissant et très apprécié. 180 portions de plat chaud servies, 10 repas avec la ramasse.'),
(3, 4, '2022-05-04', 170, 'Problème de quantité de viande... nous avons servi une trentaine de personnes avec seulement des légumes et pour une vingtaine d''autres nous avons donné des saladières. '),
(3, 4, '2022-05-05', 150, 'Repas apprécié , quiches aussi, pas assez de barquettes du coup. Beaucoup de familles et d’enfants '),
(3, 4, '2022-05-06', 170, 'Bonne distribution.  message pour toute la semaine prochaine il faut donner à Nilo le Bulgare (de forte corpulence), un repas en plus pour son ami Valentin qui est covidé et donc ne peut sortir '),
(3, 4, '2022-05-08', 150, 'RAS plus de saladiere dans le camion des minimes '),
(3, 4, '2022-05-09', 120, 'Bonne ambiance peu de monde ( début de mois ?)., rab plats chauds yaourt ramasse redistribués sur site.'),
(3, 4, '2022-05-10', 150, 'Repas très apprécié. Un bénéficiaire a été très lourd parce qu''on lui a refusé du sucre (il voulait en ramener à sa tente). Et merci aux Enfoirés d''avoir animé la soirée !'),
(3, 4, '2022-05-11', 160, 'Bonne distribution. Les derniers  arrivés tardivement ont eu des saladières et du pain. '),
(3, 4, '2022-05-12', 160, 'Tout très bien, prépa, repas et ambiance '),
(3, 4, '2022-05-13', 150, 'Distribution calme - bonne ambiance .Nous n''avons pas trouvé les fouets pour la soupe.'),
(3, 4, '2022-05-14', 150, 'RAS'),
(3, 4, '2022-05-15', 185, ''),
(3, 4, '2022-05-16', 170, 'RAS, Bonne ambiance, repas poisson bien apprécié.'),
(3, 4, '2022-05-17', 150, 'Hachi parmentier excellent. Serait-il possible une prochaine fois faire des gastros que de purée pour les végétariens ? Il faudrait aussi éviter de stocker les saladieres, les fruits et les jerricans d''eau dans les camions par ces grosses chaleurs : dans la chambre froide ce serait mieux.'),
(3, 4, '2022-05-18', 170, 'Une vingtaine de bénéficiaires arrivés tard n''ont pas pu être servis (sauf une saladière)'),
(3, 4, '2022-05-19', 180, 'Tout parfait '),
(3, 4, '2022-05-20', 180, 'Il a manqué plus de 200 plats chauds, la ramasse n''a pas suffi , des bénéficiaires sont partis avec seulement une saladette. On ne peut pas augmenter le nombre de plats chauds?'),
(3, 4, '2022-05-21', 170, 'Distribution calme\nManquait une vingtaine de portions '),
(3, 4, '2022-05-22', 200, 'Pas suffisamment de poisson et distribuer 48 saladieres à  l avenir je penses qu''il ns faut + de plats chauds RAS'),
(3, 4, '2022-05-23', 180, 'Bonne ambiance, manquait couverts en  prépa camion, pas assez de rubalise, plats chauds suffisants au final pour 180 mais pas assez de barquettes, ramasse distribuée squat.'),
(3, 4, '2022-05-24', 160, 'Plat chaud très apprécié, beaucoup de retours positifs.'),
(3, 4, '2022-05-25', 200, 'Beaucoup de monde ce soir mais une bonne ambiance. '),
(3, 4, '2022-05-26', 180, 'Beaucoup de monde et nous avons répartis les bénévoles sur les 3 sites. Repas apprécié. Camion minimes : grosse odeur de brûlé !  (CM 587 SR) à vérifier merci'),
(3, 4, '2022-05-27', 175, 'Beaucoup de bénéficiaires, notamment des nouveaux visages. Nous avons tout écoulé et nous avons distribué quelques saladieres pour compléter. Sinon très bonne ambiance. RAS.'),
(3, 4, '2022-05-28', 190, 'De + en + de bénéficiaires..'),
(3, 4, '2022-05-29', 220, 'environ on avait plus rien n''y en chaud n''y en salades n''y yaourts rien le camion à été vite déchargez par contre juste une question on a dû retirer tte les gastros de sur l échelle des 3 sites minede rien c''est beaucoup '),
(3, 4, '2022-05-30', 200, 'Bonne ambiance malgré quelques resquilleurs file d attente, pas assez de sucre. Pas les bananes ds le camion et si possible jerrican au frais qd il fait chaud svp.'),
(3, 4, '2022-05-31', 200, '170 repas chauds + 20 repas de la ramasse + 10 saladieres. On a aussi distribué du pain ramené par la maraude.\nBeaucoup de monde mais ça c''est bien passé.'),
(3, 4, '2022-06-01', 180, 'Environ une dizaine de personnes n''a pas pu être servie malgré la ramasse. Début de dispute en fin de distri parce que nous n''avions plus rien à donner. '),
(3, 4, '2022-06-02', 160, 'Le repas a bien été apprécié un plat de gratin en plus à prévoir merci '),
(3, 4, '2022-06-03', 180, 'tout s''est très bien passé. Heureusement que le nombre de repas a été augmenté, les bénéficiaires sont de plus en plus nombreux. Repas apprécié.'),
(3, 4, '2022-06-04', 210, 'RAS '),
(3, 4, '2022-06-05', 150, 'RAS juste en bénévoles '),
(3, 4, '2022-06-06', 160, 'Bonne ambiance, moins d affluence début de mois versement prestations sociales". Avons du ramener-jeter le surplus de plats chauds par manque de contenants pr redistribution sur site ou en squat :-(...et J.JULIEN n''avait pas de plats chauds :-(.'),
(3, 4, '2022-06-07', 190, '32  barquettes remplies avec la salade de riz (très bonne) 170 plats chauds. Rab distribué sur place avec du pain ramené par la maraude. Quelques personnes ont ralé à cause du pain de mie. Pas assez de café (on avait que 2 petites cafetières).'),
(3, 4, '2022-06-08', 180, 'Nous avons rapidement manqué de légumes, dommage...'),
(3, 4, '2022-06-09', 145, ''),
(3, 4, '2022-06-10', 175, 'pas très évident de distribuer avec si peu de place et le bruit de la fête foraine.'),
(3, 4, '2022-06-11', 190, 'Ras'),
